INSERT INTO `#TABLE_PREFIX#_about_us` VALUES("1","2010-05-19 13:17:28","1","2020-05-11 08:15:01","1","10","About Our Organization","<p>Colombia en Pittsburgh was founded in the fall of 2002 by graduate students at the Carnegie Mellon University, the University of Pittsburgh, and the Duquesne University and some local residents as a university-community based organization.  The organization has been meeting regularly since its creation and today has grown into an organization with links to the larger community of Pittsburgh. In July, 2012, Colombia en Pittsburgh became a 501(c)(3) non-profit organization.</p>\n<h4>Our Mission</h4>\n<p>CEP strives to:</p>\n<ul>\n<li>Work for the well-being of Colombians in Pittsburgh (US) and in Colombia on a short and long term process</li>\n<li>Facilitate mutual help and integration among Colombians in Pittsburgh and the surrounding region</li>\n<li>Promote the participation of Colombians in the civic, cultural and economic life of Pittsburgh and the surrounding region </li>\n<li>Create spaces for dialogue and learning about Colombia </li>\n<li>Support philanthropic projects in Colombia and Pittsburgh</li>\n</ul>\n<h4>Our Vision</h4>\n<p>CEP is united by its commitment to Colombia and motivated by the strong desire for collaboratiion among us and others who we can assist. Given the unique opportunities available to the organization, CEP strives to apply its collective knowledge, abilities, energy, and resources to better understand and work for Colombia. The group aims to establish an open space where exercising tolerance and respect, turns good ideas into actions. United, CEP is able to multiply our resources to support projects of large social impact in Colombia and in the U.S. Promoting the study of the multiple aspects of Colombia to the audiences of another country conveys benefits to all, Colombians and citizens of the world. CEP believes that interaction among us will allow us to create strong bonds of friendship and will enrich our life experience in Pittsburgh. CEP welcomes all the Colombians that arrive to the city, sheltering and assisting them as their family.</p>\n<p><em>Colombia en Pittsburgh is a 501(c)(3) non-profit organization.</em></p>","0","whoweare","about");
INSERT INTO `#TABLE_PREFIX#_about_us` VALUES("2","2010-05-19 13:19:12","1","2018-01-05 15:49:48","1","40","Statutes and Code of Ethics","<h4>Statutes</h4>\n<p><a href=\"/files/CEP_Estatutos.pdf\">Download (PDF)</a></p>\n<h4>Code of Ethics</h4>\n<ul>\n<li>All members of the organization are committed to respect and actively promote the well being and freedom of each member regardless of their political beliefs, religion, social status, origin, education, and sexual orientation. Each member will be considered valuable on its own and free to pursue his or her own objectives.</li>\n<li>We consider valuable the exchange of various opinions in the exercise of tolerance, mutual learning, and social benefit.</li>\n<li>Members will not use the organization for personal benefit or that of other external organizations. In the case of affairs that might affect the private interest of members, those affairs must be made public.</li>\n<li>All members promise to conduct themselves with cordiality and courtesy, and seek understanding and cooperation directly or through a third person in the event of personal disagreements.</li>\n<li>As an extreme measure and after serious consideration, the members of the organization, trough a two-thirds majority vote, could expel another member who doesn\'t follow the previous ethics policy and/or endanger the existence and well being of the organization or its members.</li>\n</ul>","0","statutes","statutes-code-ethics");
INSERT INTO `#TABLE_PREFIX#_about_us` VALUES("3","2010-05-19 13:20:13","1","2018-01-05 15:49:45","1","30","Philanthropy","<p>Some of our past initiatives...</p>\n<h4 class=\"divider\">2010 Book Drive</h4>\n<p>Colombia en Pittsburgh will be collecting your used books on an ongoing basis. All books will be donated to Carnegie Library of Pittsburgh.</p>\n<p>Promote CEP, support the needs of the growing Spanish-speaking community in Pittsburgh, and clean out your bookshelves! We are counting on you to make the book drive a success and to reach 100 book donations!</p>\n<p><a href=\"/contact/\"><b>Contact us if you have any questions, or to schedule a book drop-off or pick-up.</b></a></p>\n<h4 class=\"divider\">Journals, Books, Computers</h4>\n<p>Do you have journals, books or computers that you would like to donate?</p>\n<p>The \"Colombia en Pittsburgh\" group is collecting different educational items to send to libraries and schools in Colombia. Through academic, cultural and social activities we raise money to cover the expenses of transporting goods that could benefit many students and support the work of academic communities in our troubled country.</p>\n<p>Please contact us and let us know what you would like to donate. We will pick the donations up and once we send them, we will inform you who the recipients of your help were.</p>\n<h4 class=\"divider\">2002 Hammock Raffle</h4>\n<p>The little fellas who appear in the following photographs are Colombian kids, from \"El Portal\", receiving some T-shirts, and from the \"Fundacion Milagro de amor\" (\"Miracle of Love Fundation\") with their new beds. Both the T-shirts and the beds were the fruit of our 2002 Hammock Raffle.</p>","0","philanthropy","philanthropy");
INSERT INTO `#TABLE_PREFIX#_about_us` VALUES("4","2010-05-19 13:21:00","1","2013-06-12 21:30:00","1","70","Links","<ul>\n<li><a href=\"http://www.colombiavision.org/\" target=\"_blank\">Colombia Vision</a></li>\n<li><a href=\"http://www.colombiaespasion.com/\" target=\"_blank\">Colombia es pasión</a></li>\n<li><a href=\"http://www.yocreoencolombia.com/\" target=\"_blank\">Yo Creo en Colombia!</a></li>\n<li><a href=\"http://www.lacunet.org/\" target=\"_blank\">Latin American Cultural Union (LACU)</a></li>\n<li><a href=\"http://www.ucis.pitt.edu/clas/\" target=\"_blank\">Center for Latin American Studies (CLAS), University of Pittsburgh</a></li>\n<li><a href=\"http://www.elcorolatino.com/\" target=\"_blank\">Coro LatinoAmericano</a></li>\n<li><a href=\"http://www.chilepitt.org/\" target=\"_blank\">Comunidad de Chilenos en Pittsburgh (Chilean Community in Pittsburgh)</a></li>\n<li><a href=\"http://www.globalpittsburgh.org/\" target=\"_blank\">Global Pittsburgh</a></li>\n</ul>","1","links",NULL);
INSERT INTO `#TABLE_PREFIX#_about_us` VALUES("5","2010-05-19 13:21:27","1","2018-01-05 15:49:53","1","50","Amigos of Colombia en Pittsburgh","<p>Colombia en Pittsburgh would like to extend a special thanks to those companies and organizations who have provided us with support in the past and have enabled us to continue to reach for our goals.</p>","0","amigos","amigos");
INSERT INTO `#TABLE_PREFIX#_about_us` VALUES("6","2010-05-19 13:22:00","1","2018-01-05 15:49:59","1","60","Become a Volunteer","<p>Colombia en Pittsburgh is always looking for new volunteers. No matter how little or how much time you have to give, we can use your help with event planning and organization, food preparation, community outreach, donations and more. If you would like to become involved, <a href=\"/contact/\">contact us today!</a></p>","0","volunteer","volunteer");
INSERT INTO `#TABLE_PREFIX#_about_us` VALUES("7","2014-08-11 09:33:57","1","2019-08-09 17:48:30","1","20","Board of Directors","<div class=\"intro\">\n<p><strong>Ella Serrato</strong><br />President</p>\n<p><strong>Braulio Silva</strong><br />Vice President</p>\n<p><strong>Carlos Ramirez</strong><br />Treasurer</p>\n<p><strong>Maria Cecilia Q. Dancisin</strong><br />Secretary</p>\n</div>\n<!--\n<p><em>For the period April 2016 – April 2017</em></p>\n<p><strong></strong><strong>Braulio Silva</strong><br />President</p>\n<p><strong></strong><strong>Ella Serrato</strong><br />Vicepresident</p>\n<p><strong>Carlos Ramirez<br /></strong>Treasurer</p>\n<p><strong>Maria Cecilia Q. Dancisin</strong><br />Secretary</p>\n<p><strong>Wilson Nova</strong><br />Past - President</p>\n<p><strong> </strong></p>\n-->","0","board","board-directors");

