INSERT INTO `#TABLE_PREFIX#_catleya_recipients` VALUES("1","2009-09-24 21:42:19","1","2009-09-24 22:35:29","1","<p>Dr. Drennan holds the position of distinguished professor at the University of Pittsburgh Anthropology Department. A native of Kentucky, Dr. Drennan completed his undergraduate studies at Princeton University, and then continued his education at University of Michigan, receiving his PhD in 1975. Dr. Drennan then joined the University of Pittsburgh faculty in 1977 and ever since has played an active role both within the University setting and beyond. Dr. Drennan was instrumental in the creation of the Latin American Archaeology Program in 1988, and is the Director of the University of Pittsburgh Latin American Archaeology Publications. In 2004, he was elected to the National Academy of Sciences, one of only three University of Pittsburgh professors to receive this honor. Dr. Drennan has also maintained an active and vital international role. Since 1983, he has been a Visitant Professor in the Anthropology Department of the Universidad de los Andes, Bogot‡, Colombia. Together with Carlos Uribe, a doctoral graduate of the University of Pittsburgh and former chair of the Anthropology Department at the Universidad de los Andes and colleagues from other anthropology programs in Colombia, Dr. Drennan was a vital part of the development of a collaborative project which would operate essentially as a field school for Colombian undergraduates. This project was enthusiastically supported and authorized by the Colombian Institute of Anthropology.</p>\n<p><img src=\"/catleya/imgs/drennan1.jpg\" height=\"203\" width=\"400\" /></p>\n<p>Dr. Drennan noted in a recent National Academy of Science publication that over the past 20-plus years since its inception, more than 300 Colombian students have participated in the outreach program, with many having gone on to receive master\'s and doctoral degrees from the University of Pittsburgh and other universities abroad. \"We\'ve worked together with the institute and several Colombian universities to see that the existence of the research is of benefit to Colombia,\" Dr. Drennan says. He believes it is important for North American archaeologists to take such concerns seriously because, besides simply being the respectful way to treat colleagues in a different country, foreign archaeological research that does not take such an attitude is not likely to be permitted in the future. Dr. Drennan has been an instrumental and influential part of the Colombian anthropology community, and in the community overall, both in Pittsburgh and Colombia, and it that why Colombia en Pittsburgh recognizes his achievements with the Catleya Award and thanks him for all his hard work.</p>\n<p><a href=\"http://www.pitt.edu/%7Epittanth/faculty/drennan.html\">http://www.pitt.edu/~pittanth/faculty/drennan.html</a></p>","Dr. Robert D. Drennan","2007","The 2007 Catleya Award was presented to Dr. Drennan in recognition of the work he has done for Colombian anthropology community, and in the community overall, both in Pittsburgh and Colombia.");
INSERT INTO `#TABLE_PREFIX#_catleya_recipients` VALUES("2","2009-09-24 21:44:44","1","2009-09-24 22:35:38","1","<p><img src=\"/catleya/imgs/diego-chavez2.jpg\" style=\"margin: 0pt 0pt 10px 10px; float: right;\" height=\"106\" width=\"100\" />Diego Chaves-Gnecco MD, MPH graduated from Gimnasio Moderno in Bogotá, Colombia. He obtained his title as a Medical Doctor from Pontificia Universidad Javeriana where he held a position as Instructor of Physiology and Pharmacology at the School of Medicine. From 1995 to 1998 he completed his residency in Pediatrics at Hospital Universitario San Ignacio, Clínicas Infantiles Cafan y Colsubsidio being Chief of Residents during his last year. In 1998, Dr. Diego came to Pittsburgh as a Visiting Instructor at the University of Pittsburgh, School of Medicine where he worked until 2002. He obtained a Master degree in Public Health from the University of Pittsburgh Graduate School of Public Health (GSPH), in 2000. In 2002, he joined the Pediatrics Residency Program at Children\'s Hospital of Pittsburgh and its Community Oriented Residency Education program. It was this way that in the summer of 2002 Dr. Diego created the First Pediatric Bilingual Clinic in Southwestern Pennsylvania. Since its creation, this clinic has expanded to the program Salud Para Niños (Health for the Children). At Salud Para Niños, culturally and linguistically competent primary care for children and families is complemented with activities oriented toward prevention and empowering the community about its own health. Some of the activities of Salud Para Niños include: a weekly Tuesday clinic in Oakland at the Children\'s Hospital of Pittsburgh, a monthly free clinic at the Children\'s Hospital of Pittsburgh Care Mobile and at the Birmingham Clinic, participation in the organizations of the fairs \"Al Servicio de la Comunidad\", a literacy program where children are given at not cost free bilingual books to promote literacy and learning of English as a Second Language for both children and parents, translation of health prevention materials into Spanish, and four Hispanic/Latino Car Seat Checks in which emphasis is made in car safety issues. Since its creation Salud Para Niños has enrolled more than 300 children in their programs and has provided more than one thousand visits including well child check ups and sick visits. Currently, Dr. Diego combines his activities from his fellowship in Child Development and Behavioral Pediatrics at CHP, with his activities at Salud Para Niños.</p>\n<p><img src=\"/catleya/imgs/diego-chavez.jpg\" height=\"243\" width=\"400\" /></p>\n<p>Dr. Diego has been honored with several recognitions to his work and to his services to the community. These recognitions include the Ann E. Dyson Child Advocacy Award and a CATCH grant from the American Academy of Pediatrics, and the \"Margaret Gloninger\" service award from the University of Pittsburgh, Graduate School of Public Health. In 2004 Sr. Diego was choosen by the Pittsburgh Post-Gazette as one of the Dozen Making a Difference in our Region.</p>\n<p>Colombia in Pittsburgh awarded Dr. Diego Chaves-Gnecco the Catleya Award that honors Colombians and friends of our country who their services to the community and to our country.</p>","Dr. Diego Chaves-Gnecco","2006","Dr. Diego Chaves-Gnecco was the recipient of the 2006 Catleya Award in recognition of his leadership for the promotion of children\'s healthcare within the Latin American community of Pittsburgh, as well as his program, Salud para Niños (Health for Children).");
INSERT INTO `#TABLE_PREFIX#_catleya_recipients` VALUES("3","2009-09-24 21:45:33","1","2009-09-24 22:35:55","1","<p><img src=\"/catleya/imgs/spear-photo1.jpg\" style=\"margin: 0pt 0pt 10px 10px; float: right;\" height=\"89\" width=\"100\" />Richard Spear has made the Cali orphanage for girls his mission. The objectives of his efforts are to provide a stable living environment, and quality education for the young orphan girls of Cali.</p>\n<p>Through his successful fund-raising efforts for the Cali Orphanage Fund he has raised over $300,000 from private donations as well as charitable foundation grants. The funds have also made it possible to expand the mission two other projects; the Mother of God orphanage that provides beds for 80 infants and most recently, the purchase of property in the countryside that will be home for children that are HIV positive.</p>\n<p><img src=\"/catleya/imgs/spear-photo2.jpg\" height=\"223\" width=\"400\" /></p>\n<p>After years of traveling through South America Richard decided he wanted to help in countries that needed the most help. He chose Colombia because of the vast suffering and the great need. Richard knew about Cali from a cousin who lived there for twenty years. Priests at Duquesne knew about his interest in mission work and suggested the Cali orphanage, which had been formed by the Rev. Kelvin Tam, a priest from Trinidad. Since his first visit to Cali, Richard knew it was the \"right place.\" He embraces the warmth and optimism of its people and he calls it \"his second home\".</p>\n<p>Richard works as director of intramural sports at Duquesne University and resides in Bridgeville with his wife Janet Southgate.</p>\n<p><i>For more about the Cali Orphange Fund contact:</i><br /> Richard Spear<br /> AJ Palumbo Center<br /> Duquesne University<br /> Pittsburgh 15282<br /> Phone: 412 396-6569</p>","Richard Spear","2005","Richard Spears was the recipient of the 2005 Catleya Award for his dedication for more than 10 years to fundraising for the care and education of more than 110 impoverished children living in the city of Cali, Colombia.");
INSERT INTO `#TABLE_PREFIX#_catleya_recipients` VALUES("4","2009-09-24 22:23:35","1","2009-09-28 15:49:06","1","<p>Dr. Juan Carlos Puyana is currently an Associate Professor of Surgery and Critical Care, Trauma Surgeon, Director of Surgical ICU, Director of the Surgical Critical Care Program at the University of Pittsburgh Medical Center at Presbyterian Hospital.</p>\n<p>Dr. Puyana received his M.D. from Javeriana University in Bogota Colombia. He is an Editorial Board Member of the Adult Multi-Disciplinary Critical Care Knowledge Assessment Program.</p>\n<p><img src=\"/photos/20dejulio2009/image/p1060545.jpg\" width=\"394\" /></p>\n<p>Before working at the University of Pittsburgh, Dr. Puyana was a Fellow in Surgical Critical Care at the School of Medicine, State University of New York in Stony Brook, New York. And he was also a Post Doctoral Associate/Instructor in Trauma and Surgical Critical Care in the Department of Surgery at Yale University, School of Medicine in New Haven, Connecticut.</p>\n<p>Prior to his positions at the University of Pittsburgh, Dr. Juan Puyana was a Co-Director Surgical ICU Brigham and Women’s Hospital Boston, Massachusetts, Assistant Professor of Surgery.</p>\n<p>On 9-11 Dr. Puyana was one of the Pittsburgh physicians attending a conference in New York who were recruited onto the city’s emergency medical teams to treat the injured from the World Trade Center.</p>\n<p>In 2003, Juan Carlos Puyana representing UPMC Trauma and CCM received the annual Outstanding Services Award by the Pittsburgh Insurance Club honoring him for excellent service. Dr. Puyana was singled out for his and his associates\' excellent surgical and postoperative care of a 17 year old man who suffered blunt abdominal trauma during a football game.</p>\n<p>Dr. Puyana is the author of numerous medical research publications including the book Surgical Critical Care, An Issue of Surgical Clinics (The Clinic: Surgery)</p>\n<p>Dr. Juan Carlos Puyana, has maintained close cooperation with his peers in Colombia and motivated by his desire to be able to bring something back to Colombia has found the opportunity to do so through a collaborative research program. He is the architect of traineer, a five year collaborative research program funded through a grant awarded by the Fogarty International Center at the National Institute of Health.</p>\n<p>The traineer program was established in 2007 as a partnership between Colombia and UPMC. This program enables visiting Colombian surgical doctors to pursue certificates or even Master’s Degrees in clinical research at Pitt through the Clinical Research Training Program.</p>","Dr. Juan Carlos Puyana, MD","2009","Dr. Juan Carlos Puyana is currently an Associate Professor of Surgery and Critical Care, Trauma Surgeon, Director of Surgical ICU, Director of the Surgical Critical Care Program at the University of Pittsburgh Medical Center at Presbyterian Hospital.");

