INSERT INTO `#TABLE_PREFIX#_events` VALUES("1","2009-09-25 11:38:57","1","2009-12-21 15:08:13","1","27","Seventh Annual Mallorca Charity Luncheon","<p>Colombia en Pittsburgh and <a target=\"_blank\" href=\"http://www.colombiavision.org/\">Colombia Vision</a> are very pleased to invite you to the Seventh Annual Mallorca Fundraiser Luncheon at <a target=\"_blank\" href=\"http://www.mallorcarestaurant.com/\">Mallorca Restaurant</a>, at 2228 East Carson Street in the South Side area of Pittsburgh (tel: 412-488-1818). This year, we will enjoy the musical group Besame that plays Latin-American music.</p>\n<p>Thanks to the many generous individuals who have participated in previous years, we have been able to cover the expenses of establishing and operating a children\'s library as well as supporting Hogar Angeles, a safe haven in Cartago, Colombia. With the contributions of previous luncheons, a new Home \"Luz y Esperanza\" was open. This home shelters kids in highly vulnerable situations and gives immediate attention to them. Also, the girls from the \"Hogar Angeles\" were able to go on vacations, one girl obtained her degree as a nurse and another girl traveled to the USA for an adoption program.</p>\n<p>As in previous years, the luncheon will feature a delicious Mallorca feast (with appetizers, entrees, sangria and an assortment of desserts).</p>\n<p>Please join us in this effort by attending the luncheon at the VIP level with a contribution of $100 per person or at our special contributor level of $60 per person. This year we will have 10 seats available for students at a special price of $45 (Send us a photocopy of your ID. First come, first serve). At the VIP contribution level, 60% of the donated amount is tax deductible. As a non-profit organization, Colombia Vision has 501 (c)(3) tax exempt status.</p>\n<p>This is a unique opportunity to simultaneously enjoy the best of the Iberian cuisine, the nice sound and rhythm of Besame, and the company of marvelous and generous people. We look forward to your participation. To reserve your tickets or make inquiries regarding the event and Colombia Vision, please do not hesitate to contact us via email at <a href=\"mailto:cakennedy55402@yahoo.com\">cakennedy55402@yahoo.com</a> or by calling Diana Gaitan Leon at (412) 606-3574 or Kathia Kennedy at (724) 940-3308.</p>\n<p> </p>\n<p><i>With deep appreciation for collaborating with us in this effort,</i><b><br />Colombia Visión - Colombia en Pittsburgh</b></p>","November 15, 2009 / 1pm - 4pm","<p><b>Please respond on or before November 7, 2009.</b></p>\n<p>VIP: <br />$100 per person</p>\n<p>Special Guest:<br />$60 per person</p>\n<p>Students:<br /><i>(only 10 available, first come/first serve)<br /></i>$45 per person</p>\n<p>If you can\'t attend, please consider making a donation. Every dollar counts.</p>\n<p><i>Check payable to:</i><br /><b>Colombia Vision</b><br />206 Whetherburn Dr.<br />Wexford, PA 15090</p>","Mallorca Restaurant","","CEP Event","1","http://colombiaenpittsburgh.wufoo.com/forms/r7x3p9/","","0","http://www.google.com/maps?f=d&saddr=&daddr=2228+E.+Carson+Street,+Pittsburgh,+Pennsylvania&hl=en&geocode=&mra=ls&sll=37.0625,-95.677068&sspn=33.572881,86.660156&ie=UTF8&t=h&z=16","0","0000-00-00 00:00:00");
