INSERT INTO `#TABLE_PREFIX#_events` VALUES("7","2009-09-25 15:33:24","1","2009-09-25 15:33:24","1","21","A Million Voices Against FARC","<p>We invite you to join us as we support the world-wide effort \'A Million Voices Against FARC.\' This event will include various presentations on the conflict in Colombia, as well as an opportunity to discuss the topic with Colombians living within our region. We hope you can join for this important cause.</p>\n<h3>About \'A Million Voices Against FARC\'</h3>\n<p>We need our voices to be heard. Let\'s not be silent anymore, let the world hear us; let every guerrilla, man or woman hear us: We repel FARC - EP (Revolutionary Armed Forces of Colombia - People\'s Army). We DON\'T want more armed fight.</p>\n<p>FARC has deceived the world once again by not freeing the thousands of kidnapped people they have kept captive for almost a decade now, resorting one again to all sorts of tricks and evasive lies.</p>\n<p>Kidnapping is the worst of acts against human dignity, and FARC has kidnapped and kept captive thousands of people over the last years, while they continue to grow their drug production and trafficking business, perpetrating all kinds of crimes and terrorist attacks against people, bringing poverty and misery to our country, Colombia, which has suffered this plague and humanitarian tragedy for more than forty years now.</p>\n<p>Colombia, Colombians, friends from all over the world, let\'s unite to shout loudly:</p>\n<p>NO MORE!<br /> NO MORE KIDNAPPING!<br /> NO MORE LIES!<br /> NO MORE MURDER!<br /> NO MORE FARC!</p>\n<p>Let\'s commit ourselves to join a million voices in this group so we can make a difference, and let the entire world know that we don\'t need this \'People\'s Army\' here in Colombia; that FARC is led by murderers and enemies of the Colombian and World\'s People.</p>\n<p>This is a cause beyond all political interests or colors. It\'s a humanitarian cause, encouraged by a simple sense of solidarity, for the sake and welfare of our citizens.</p>\n<p>Join us; We need our voices to be heard.</p>\n<p>You can learn more about the effort at: <br /><a href=\"http://www.colombiasoyyo.org/english.html\">www.colombiasoyyo.org/english.html</a></p>","February 4, 2008","","Carnegie Mellon University","","CEP Event","1","","","0",NULL,"0","0000-00-00 00:00:00");
