INSERT INTO `#TABLE_PREFIX#_events` VALUES("28","2009-09-25 18:46:18","1","2009-09-26 13:31:12","1","26","Colombian Independence Day Commemoration and Celebration","<p>Colombia en Pittsburgh invites you and your family to join us on Sunday, July 19, 2009 at <b>Emiliano\'s Restaurant</b> on McKnight Road in the North Hills area of Pittsburgh as we commemorate the Independence of Colombia. <a href=\"http://www.emilianos.net/\">Visit their website</a> for directions, menu and pricing information. Join us for an afternoon of great food, Colombian music, dancing and fun.</p>\n<p><b>Mass for the Peace of Colombia</b><br />As part of this celebration, a mass for the peace of Colombia will be held at 12pm at St. Regis church in Oakland. <!--On July 19, a <a href=\"/events/GlobalBeats-July26.pdf\" mce_href=\"/events/GlobalBeats-July26.pdf\" title=\"download flier\">Global Beats Colombian party</a> will be held at Ava Lounge in East Liberty.--></p>\n<h3 style=\"color: #cc0000;\">Important Note!</h3>\n<p><i>This year\'s event will <b>not</b> be held at Carnegie Mellon University</i></p>","July 19, 2009","<p><img src=\"/images/emilianos-logo.jpg\" alt=\"Emiliano\'s Restaurant\" style=\"border: 1px solid #cccccc;\" width=\"150\" /></p>\n<p><b>12:00pm</b><br />Mass for Peace in Colombia<br />St. Regis Church, Oakland<br /><a href=\"http://www.google.com/maps?q=3235+Parkview+Ave,+Pittsburgh,+PA+15213,+USA&amp;ie=UTF8&amp;z=16&amp;iwloc=addr&amp;om=1\">Map</a></p>\n<p><b>1:30pm</b><br />Luncheon &amp; Celebration<br />Emiliano\'s Restaurant<br />8600 McKnight Rd.<br />McIntyre Square<br /><a href=\"http://www.emilianos.net/directions.html\">Map</a></p>\n<p><a href=\"/photos/20dejulio2008/\">View the photos from last year\'s event.</a></p>","Emilianos Restaurant, Pittsburgh, PA","/photos/20dejulio2009/","CEP Event","1","http://jasmar.wufoo.com/forms/z7x3w1/","","0",NULL,"0","0000-00-00 00:00:00");
