INSERT INTO `#TABLE_PREFIX#_events` VALUES("31","2009-12-01 20:51:31","1","2010-01-05 12:25:42","1","28","Novena de Navidad Colombiana","<p>Los invitamos a que nos acompañen a la cuarta celebración anual de la novena de navidad colombiana. Este evento, que comenzó en el 2006 con la contribución de donantes anónimos, ha sido un éxito en los años anteriores. Este año nuevamente estamos trabajando con la organización “toys for tots” para poder distribuir los regalos de navidad a los niños de la comunidad. Les pedimos el favor que inscriban a sus niños menores de 12 años para este evento antes del 25 de octubre del 2009.</p>\n<p>La realización de la Celebración está confirmada. La Distribución de los Regalos de Navidad No Está Garantizada y Dependerá de nuestros donantes.</p>\n<p>Agradecemos desde ya su colaboración, su participación, su comprensión y su asistencia. Nos vemos el domingo 13 de diciembre – FELIZ NAVIDAD.</p>","Sunday, December 13, 2009","","Iglesia San Regis","","External Event","1","","/events/FlyerNovena2009.pdf","0","","0","0000-00-00 00:00:00");
INSERT INTO `#TABLE_PREFIX#_events` VALUES("32","2010-02-27 15:03:44","1","2010-03-18 14:07:03","1","29","Snow Tubing 2010!","<p>Bring your friends and family and join us for an afternoon of Snow Tubing at Wildwood Highlands. The cost is $16 per person for a 2 hour session. <br /><br />Contact us if you need a ride or would like to car pool.</p>\n<p><a href=\"http://www.wildwoodpa.com/\">http://www.wildwoodpa.com/</a></p>","Sunday, March 7, 11am - 1pm","","Wildwood Highlands","","CEP Event","1","","","0","http://maps.google.com/maps?f=q&source=s_q&hl=en&geocode=&q=2330+Wildwood+Road+Allison+Park,+Pa+15101&sll=40.593605,-79.980555&sspn=0.011862,0.025041&gl=us&ie=UTF8&hq=&hnear=2330+Wildwood+Rd,+Allison+Park,+Allegheny,+Pennsylvania+15101&ll=40.593605,-79.980576&spn=0.011862,0.016866&z=16","0","0000-00-00 00:00:00");
