INSERT INTO `#TABLE_PREFIX#_events` VALUES("37","2010-09-01 22:22:05","1","2010-12-12 11:56:57","1","34","Eighth Annual Mallorca Charity Luncheon","<p><a href=\"http://www.colombiavision.org/\">Colombia Vision</a> and Colombia en Pittsburgh are very pleased to invite you to the Eighth Annual Mallorca Fundraiser Luncheon at <a href=\"http://www.mallorcarestaurant.com/\">Mallorca Restaurant</a>, at 2228 East Carson Street in the South Side area of Pittsburgh (tel: 412-488-1818). This year, we will enjoy the musical group <a href=\"http://www.besamepittsburgh.com/\">Bésame</a> that plays Latin-American music.</p>\n<p>Thanks to the many generous individuals who have participated in previous years, we have been able to cover the expenses of establishing and operating a children\'s library as well as supporting Hogar Angeles, a safe haven in Cartago, Colombia. With the contributions of previous luncheons, a new Home \"Luz y Esperanza\" was open. This home shelters kids in highly vulnerable situations and gives immediate attention to them.</p>\n<p>As in previous years, the luncheon will feature a delicious Mallorca feast (with appetizers, entrees, sangria and an assortment of desserts).</p>\n<p>Please join us in this effort by attending the luncheon at the VIP level with a contribution of $100 per person or at our special contributor level of $60 per person. This year we will have 10 seats available for students at a special price of $45 (Send us a photocopy of your ID. First come, first serve). At the VIP contribution level, 60% of the donated amount is tax deductible. As a non-profit organization, Colombia Vision has 501 (c)(3) tax exempt status.</p>\n<p>This is a unique opportunity to simultaneously enjoy the best of the Iberian cuisine, the nice sounds and rhythm of Bésame, and the company of marvelous and generous people. We look forward to your participation. To reserve your tickets or make inquiries regarding the event and Colombia Vision, please do not hesitate to contact us via email at <a href=\"mailto:cakennedy55402@yahoo.com\">cakennedy55402@yahoo.com</a> or by calling Kathia Kennedy at (724) 940-3308.</p>\n<p>With deep appreciation for collaborating with us in this effort, Colombia Vision and Colombia en Pittsburgh</p>","Sunday, November 7, 2010 / 1pm &ndash; 4pm","<p><strong>Please respond on or before November 1, 2010.</strong></p>\n<p><strong>VIP:</strong><br /> $100 per person</p>\n<p><strong>Special Guest:</strong><br /> $60 per person</p>\n<p><strong>Students:</strong><br /> <i>(only 10 available, first come/first serve)</i><br /> $45 per person</p>\n<p>If you can\'t attend, please consider making a donation. Every dollar counts.</p>\n<p><strong>Check payable to:</strong><br /> Colombia Visión<br /> 206 Whetherburn Dr.<br /> Wexford, PA 15090</p>","Mallorca Restaurant","","CEP Event","1","http://colombiaenpittsburgh.wufoo.com/forms/mallorca-charity-luncheon-rsvp/","","0","http://maps.google.com/maps?q=mallorca+restaurant&oe=utf-8&client=firefox-a&ie=UTF8&hl=en&ll=40.428574,-79.973388&spn=0.009049,0.019355&z=16&iwloc=A","0","0000-00-00 00:00:00");
INSERT INTO `#TABLE_PREFIX#_events` VALUES("38","2010-10-22 08:31:43","1","2010-10-26 17:05:18","1","35","Bésame CD Release Party","<p>After five years of sharing culture through music, Besame will launch  their first album, Primer Beso (First Kiss), on Sunday, October 24.</p>\n<p>Besame  specializes in Latin American music, with special emphasis on the  sounds of Colombia. Their unique musical combination was born in 2005,  when Jorge Delgado, Paul Cindric and Melissa Alliston were invited to  play at the Colombian Independence Day celebration hosted by Colombia in  Pittsbu<span></span><span>rgh. The infamous Roger Day was added a few  months later to complete their sound. All four provide vocals and  instrumentals throughout their performance, with Jorge on guitar, Paul  on soprano sax, Melissa on percussion and Roger on tuba. This eclectic  mix allows them to achieve everything from a pseudo big-band sound to  modern popular music.<br /><br />With Primer Beso, Besame brings on a  collection of mostly Colombian tunes, with a few other countries thrown  in for fun. To reach out to a larger audience, they also weave English  lyrics through some of their arrangements. Originally from Bogota,  Colombia, Jorge is Besame’s musical impetus, and Primer Beso is the  vehicle the group will use to take listeners on an audio tour that  includes the rhythms of cumbia, porro, currulao, bolero, cha cha cha and  even a gato (though perhaps not the one the Spanish majors in the room  are imagining). Recorded in Pittsburgh at El Sotano, Primer Beso  captures the feel of a live presentation so fans can have a piece of the  show to take home with them.<br /><br />The launch is a free event that is  both open to the public and family friendly. Thanks to the sponsorship  of Pitt’s Center for Latin American Studies, the release will be  celebrated in the Ballroom of the William Pitt Student Union in  Pittsburgh’s Oakland neighborhood. Support is also provided by the Latin  American Cultural Union and Colombia in Pittsburgh. For more  information about Besame and the launch, you can visit them online at <a href=\"http://www.besamepittsburgh.com/\" onmousedown=\"UntrustedLink.bootstrap($(this), &quot;0f0d0&quot;, event);\" rel=\"nofollow\" target=\"_blank\">www.besamepittsburgh.com</a><span>, send  an e-mail to info@besamepittsburgh.com,</span><wbr></wbr><span></span> or look them up on Facebook.</span></p>","Sunday, October 24 / 6pm","<p>The Ballroom at William Pitt Union<br /> 4200 Fifth Avenue (at Bigelow)<br /> Pittsburgh (Oakland), PA 15213</p>","","","CEP Event","1","","","0","http://goo.gl/maps/dYnK","0","0000-00-00 00:00:00");
INSERT INTO `#TABLE_PREFIX#_events` VALUES("39","2010-12-12 12:03:06","1","2011-03-28 08:46:35","1","38","Novena navidena","<p>La navidad esta aqui! y queremos aprovechar para reunirnos y saludarlos !</p>\n<p>Colombia en Pittsburgh los invita a una novena navideña el martes 21 de diciembre a las 6:00 pm.</p>\n<p>Fecha: martes, 21 de diciembre<br />Hora: 6:00 p.m.<br />Lugar: Tango Café</p>\n<p><a href=\"/http::/www.tangocafepgh.com\">http:://www.tangocafepgh.com</a></p>\n<p>Direccion:<br />5806 Forward Avenue<br />Pittsburgh , PA 15217<br />(412) 421-1390</p>\n<p>Los esperamos!</p>","Martes, 21 de diciembre","","Tango Café","","CEP Event","1","","","0","http://goo.gl/maps/6cy9","0","2010-12-21 19:00:00");
