INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("3","2012-06-16 06:42:23","1","2014-06-12 15:33:33","1","1","Fiesta de Independencia de Colombia","fiesta-de-independencia-de-colombia","0","0","past","2012-06-16 00:00:00",NULL,NULL,"","0","0","<p><strong>Sunday, July 22, 2012</strong><br />12:00pm – 4:00pm</p>\n<p>Saint Regis Parish<br />3235 Parkview Ave<br />Pittsburgh, PA 15213-4513<br /><a href=\"https://maps.google.com/maps?q=3235+Parkview+Ave+Pittsburgh,+PA+15213-4513&amp;oe=utf-8&amp;client=firefox-a&amp;hnear=3235+Parkview+Ave,+Pittsburgh,+Pennsylvania+15213&amp;gl=us&amp;t=m&amp;z=16\">Map/Directions</a></p>\n<p>Conmemorar la independencia de Colombia (20 de Julio) en compañia de amigos latinos, dando gracias a Dios y compartiendo su cultura gastronomica y musical...y pasarla rico!!!.</p>","","https://www.facebook.com/events/345160702217263/","More information","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("4","2012-08-05 20:52:45","1","2016-02-16 12:41:18","1","1","Meeting: Friday September 14","meeting-friday-september-14","1","0","past","2012-08-05 00:00:00","","","","0","0","<p>Queridos Amigos y Miembros De Colombia en Pittsburgh</p>\n<p>Nos complace informarles que a partir del mes de julio de 2012 Colombia en Pittsburgh se ha establecido como una Organización sin ánimo de lucro ante el gobierno federal y estatal, este nuevo estatus de la organización nos permite como grupo crear nuevas metas y tener más capacidad de crecimiento en el área de Pittsburgh, pero también significa que necesitamos gente comprometida a trabajar por las causas que nos interesan como Colombianos en Pittsburgh.</p>\n<p>Queremos hacerlos partícipes de esta nueva etapa que estamos iniciando y les pedimos su apoyo y continua colaboración.</p>\n<p>Convocamos a todos los interesados a una reunión extraordinaria que se llevará a cabo el día viernes 14 de septiembre en el Panera de Oakland - 3401 Blvd Of The Allies, Pittsburgh, PA a las 7:00 pm para tratar temas como el nombramiento de la nueva junta y las actividades de la organización para los meses que restan del 2012.</p>\n<p><em>Esperamos verlos allá!</em></p>\n<hr />\n<p>Dear Friends and Members of Colombia en Pittsburgh</p>\n<p>We are happy to let you know that starting in July 2012, Colombia en Pittsburgh has been established as a Non-Profit Organization under State and Federal Laws, this new status will allow us to create new goals and expand our growth capacity in the Pittsburgh Area, but it also means that we need people to work with us for the goals that as Colombians in Pittsburgh are of interest to us.</p>\n<p>We would like to count with you and ask for your support and collaboration and invite you to attend to the meeting we are having on Friday September 14, 2012 at 7 pm at Panera in Oakland - 3401 Blvd of The Allies, Pittsburgh, PA, to talk about the new board and the activities for the upcoming months.</p>\n<p><em>We hope to see you there!</em></p>","","","","0","","");
