INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("7","2012-10-20 09:22:27","1","2017-07-05 15:31:57","1","2","Introducing the new Colombian Consulate in Newark","introducing-new-colombian-consulate-newark","0","0","past","2012-10-20 00:00:00","","","","0","0","<p>Members of Colombian en Pittsburgh have recently been in touch with the new Colombian Consulate, based in Newark, NJ. He is available to answer any questions you may have. And planning is underway for him to visit Pittsburgh in the future.</p>\n<p><strong>Christian Mauricio Rodriguez Anzola</strong><br />862.279.7888<br />550 Broad Street<br />15th Floor<br />Newark, New Jersey, 07102<br /><a href=\"mailto:cnewark@cancilleria.gov.co\">cnewark@cancilleria.gov.co</a></p>","","http://www.colombiaemb.org/Consular_Directory","Embassy of Colombia - Consular Directory","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("8","2013-05-22 08:28:31","1","2014-06-12 15:29:56","1","1","Join us for \"Fiesta de Independencia de Colombia 2013\" on Sunday, July 21, 2013","join-us-fiesta-de-independencia-de-colombia-2013-sunday-july-21-2013","0","0","past","2013-07-17 00:00:00",NULL,NULL,"<iframe width=\"425\" height=\"350\" frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\" src=\"https://maps.google.com/?ie=UTF8&amp;ll=40.440415,-79.895539&amp;spn=0.011268,0.019805&amp;t=m&amp;z=16&amp;iwloc=lyrftr:m,9409141888098117714,40.439157,-79.898286&amp;output=embed\"></iframe><br /><small><a href=\"https://maps.google.com/?ie=UTF8&amp;ll=40.440415,-79.895539&amp;spn=0.011268,0.019805&amp;t=m&amp;z=16&amp;iwloc=lyrftr:m,9409141888098117714,40.439157,-79.898286&amp;source=embed\" style=\"color: #0000ff; text-align: left;\">View Larger Map</a></small>","0","0","<p>Colombia en Pittsburgh invites you and your family and friends to join the Colombian community on <strong>Sunday, July 21, 2013</strong>, from 2pm to 7pm, as we commemorate the Independence of Colombia. Join us for an afternoon of great food, Colombian music, dancing and fun. The event will take place at the Forbes &amp; Braddock Pavillion and Playground in Frick Park, located in the Regent Square neighborhood of Pittsburgh (map below). </p>","<p>The event will be picnic style. Seating is limited so we suggest that you bring your own chairs and a blanket for sitting in the grass. There will a few vendors on site selling food and drinks (cash only). </p>","http://goo.gl/maps/5NE7l","Get Directions","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("9","2013-06-04 08:30:25","1","2014-06-12 15:30:14","1","1","Colombian Artist, Jontre, to perform at the Three Rivers Arts Festival!","colombian-artist-jontre-perform-three-rivers-arts-festival","0","0","past","2013-06-04 00:00:00",NULL,NULL,"","0","0","<p>Colombian Artist, Jontre, to perform at the Three Rivers Arts Festival as Part of \"World Music Day\" supported by Vibrant Pittsburgh and presented in partnership with Global Beats.</p>\n<p>Friday, June 14<br />12:00 pm - 1:00 pm and 6:30 pm - 7:15 pm<br /><em>Dollar Bank Stage</em></p>\n<p><strong>About Jontre</strong><br />Jontre performs an upbeat appealing blend of Latin and African American grooves with Colombian flavor. His catchy melodies, intelligent and up-lifting lyrics compel audiences to dance, love and get a little crazy. Colombian Folkloric rhythms like Cumbia and Porro fuse seamlessly with tumbaos de Salsa bolero, blues, funk and even merengue. Jontre’s music and velvety baritone exude passion transporting us to a world of harmony aware of our inner nature. His positive energy is contagious; the stage is a vehicle to share his feelings of peace and joy.</p>","","http://www.3riversartsfest.org/fest_event/jontre/","Learn more at 3riversartsfest.org","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("10","2013-06-04 16:13:43","1","2014-06-12 15:32:55","1","1","Watch Colombia vs. Argentina at Chicken Latino","watch-colombia-vs.-argentina-chicken-latino","0","0","past","2013-06-04 00:00:00",NULL,NULL,"","0","0","<p><span color=\"#333333\" face=\"\'lucida grande\', tahoma, verdana, arial, sans-serif\" size=\"1\">Colombia Vs. Argentina<br /></span><em>eliminatorias World Cup 2014</em></p>\n<p><strong>Friday , June 7, 2013 at 6:30pm</strong></p>\n<p><strong>Chicken Latino</strong><br />155 21st Street (the Strip District)<br />Pittsburgh, PA 15222<br /><a href=\"http://www.chickenlatino.com/\">http://www.chickenlatino.com/</a></p>\n<p>BYOB! But please plan to support the restaurant by eating there.<span><span><br /></span></span></p>","","http://www.chickenlatino.com/﻿","visit chickenlatino.com","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("11","2013-06-15 15:40:41","1","2014-06-12 15:30:08","1","1","Fiesta de Independencia de Colombia 2013: Crafts and Food Reservations","fiesta-de-independencia-de-colombia-2013-crafts-food-reservations","0","0","past","2013-06-13 00:00:00",NULL,NULL,"","0","0","<p>En caso de que esten interesados, les pedimos por favor que completen el siguiente formulario. Pronto nos comunicaremos con detalles adicionales e instrucciones de como hacer el pago correspondiente. Les solicitamos hagan dicho pago a mas tardar el <strong>25 de junio</strong> proximo.</p>\n<p><strong><a href=\"/show.php?8\">La Fiesta de Independencia de Colombia 2013</a></strong> es una magnifica oportunidad para compartir nuestra cultura! este ano queremos abrir las puertas para que ustedes puedan participar activamente ofreciendo artesanias y delicias culinarias!</p>","","/20dejulio/reservation.php","Reserve now","0","","");
