INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("13","2013-06-26 10:20:38","1","2014-06-12 15:30:00","1","1","The Pittsburgh Riverhounds present \"Latino Heritage Night - July 6, 2013","pittsburgh-riverhounds-present-latino-heritage-night-july-6-2013","0","0","past","2013-06-26 00:00:00",NULL,NULL,"","0","0","<h4>Pittsburgh Riverhounds vs Los Angeles Blues<br />Saturday, July 6, 2013, 7pm<br />Highmark Stadium</h4>","<p>Enjoy and exciting evening of soccer with friends, live music, drink specials, giveaways, and more!</p>\n<p><strong>Special ticket rate: $9</strong></p>\n<p><em>To secure your ticket:</em></p>\n<ul>\n<li><em>Visit <a href=\"http://ticketmaster.com\">ticketmaster.com</a> and search for \"Pittsburgh Riverhounds\"</em></li>\n<li>Select the July 6th game</li>\n<li>Use promo code \"LATIN\" to receive the $9 rate</li>\n<li>Call 412-224-4900 (box office) or email Natalie Mikula at <a href=\"mailto:nmikula@riverhounds.com\">nmikula@riverhounds.com</a> with questions</li>\n</ul>\n<p></p>","/files/Riverhounds-LatinoHeritageNight.pdf","Download the Flier","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("14","2013-09-15 17:48:25","1","2015-03-29 23:05:34","1","1","Consulado Móvil de Colombia en Newark visitará Pittsburgh (updated prices)","consulado-movil-de-colombia-en-newark-visitara-pittsburgh-updated-prices","0","0","past","2013-10-17 00:00:00",NULL,NULL,"","0","0","<p>El Consulado Móvil de Colombia en Newark visitará Pittsburgh el día 19 de octubre y nos ha solicitado le indiquemos los trámites que los colombianos de la región requieren. Por dicha razón amablemente les solicitamos completen el formulario copiado abajo antes del 6 de octubre, fecha en la cual debemos remitir la información al consulado.</p>","<p>Al completar el formulario, por favor tengan en cuenta la información incluida en <a href=\"/admin/uploads/colombianconsulate-inpittsburgh.pdf\"><strong>el documento adjunto</strong></a>.</p>\n<p>También, para asegurar que los documentos lleguen con prontitud a su destino, asegúrense de llevar consigo correo certificado prepagado (USPS, UPS or Fedex)</p>\n<p><strong>Dónde</strong><br />Wesley W. Posvar Hall<br />Salon: 4130<br />230 South Bouquet Street<br />Pittsburgh, PA 15260</p>\n<p><strong>Cuándo</strong><br />Sábado 19 de octubre<br />10:00 am – 2:00 pm</p>\n<p>---</p>\n<p>The Colombian Consulate will visit Pittsburgh on October 19 and has requested that we let them know what services the Colombian community needs by October 6.<br />Please complete the form below by that date so we can send the information to the Consulate.</p>\n<p>When completing the form, please keep in mind the information included in <a href=\"/admin/uploads/colombianconsulate-inpittsburgh.pdf\"><strong>the attached document</strong></a>.</p>\n<p>Also, to make sure the documents arrive to you promptly, please bring a certified pre-paid envelope (USPS, UPS or Fedex)</p>\n<p><strong>Where</strong><br />Wesley W. Posvar Hall<br />Room: 4130<br />230 South Bouquet Street<br />Pittsburgh, PA 15260</p>\n<p><strong>When</strong><br />Saturday 19 de octubre<br />10:00 am – 2:00 pm</p>\n<p>---</p>\n<p><span style=\"color: #ff0000;\"><strong>Tenga en cuenta que los precios de los servicios que presta el consulado cambiaron a partir de octubre 1, 2013.</strong></span></p>\n<p><span style=\"color: #ff0000;\"><strong>Please note that the prices of some services have changed as of October 1, 2013.</strong></span></p>\n<p><img src=\"/admin/uploads/pricelist.png\" width=\"481\" height=\"581\" /></p>","","Learn more","0","","<div id=\"wufoo-z7x4m1\">\n</div>\n<script type=\"text/javascript\">var z7x4m1;(function(d, t) {\nvar s = d.createElement(t), options = {\n\'userName\':\'colombiaenpittsburgh\', \n\'formHash\':\'z7x4m1\', \n\'autoResize\':true,\n\'height\':\'1292\',\n\'async\':true,\n\'header\':\'hide\', \n\'ssl\':true};\ns.src = (\'https:\' == d.location.protocol ? \'https://\' : \'http://\') + \'wufoo.com/scripts/embed/form.js\';\ns.onload = s.onreadystatechange = function() {\nvar rs = this.readyState; if (rs) if (rs != \'complete\') if (rs != \'loaded\') return;\ntry { z7x4m1 = new WufooForm();z7x4m1.initialize(options);z7x4m1.display(); } catch (e) {}};\nvar scr = d.getElementsByTagName(t)[0], par = scr.parentNode; par.insertBefore(s, scr);\n})(document, \'script\');</script>\n");
