INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("19","2014-05-28 23:06:35","1","2017-10-04 17:13:49","1","1","Conmemoración de la Independencia de Colombia 2016","conmemoracion-de-la-independencia-de-colombia-2016","0","0","past","2016-07-23 00:00:00","11:00 am - 6:00 pm","Schenley Park Ice Rink<br/>\nOverlook Drive<br/>\nPittsburgh, PA 15213","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2112.836781107259!2d-79.94397801271134!3d40.433538807133026!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834f18dab793e3f%3A0xe4a68c7f4d82a670!2sSchenley+Park+Ice+Rink!5e0!3m2!1sen!2sus!4v1461023183909\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>","0","0","<!--\n<h5>11:30 am / Misa en Español  <strong></strong></h5>\n<p>El sábado 18 de julio se celebrará la misa en español por las intenciones de todos los Colombianos en especial las intenciones de los Colombianos en Pittsburgh. La misa tendrá lugar en el mismo sitio y previa al resto de la celebración</p>\n-->\n<h5>11:00 am / Misa<br />12:00  – 6:00 pm / Celebración en comunidad</h5>\n<p>Disfrute de deliciosa comida colombiana, postres, agua, jugos, gaseosas</p>\n<p>Por favor traiga sus propias bebidas alcoholicas (BYOB) y su identificacion.<br />DESCORCHE: $5</p>\n<p><em>Todos están invitados!</em></p>","<p>11:00 am / Misa en Español<br />Se celebrará la misa en español por las intenciones de todos los Colombianos en especial las intenciones de los Colombianos en Pittsburgh. La misa tendrá lugar en el mismo sitio y previa al resto de la celebración</p>\n<p>12:00 pm a 6:00 pm / Programa General Invitados Especiales:<br />* Grupo Zafarrancho (Colombia)<br />* Grupo Bésame (Colombia y USA)<br />* Latina Production (Venezuela, Colombia)<br />* Zumba by Sarita Wells (Perú)<br />* DJ Juan Diego (Puerto Rico)</p>\n<p>Tambien tendremos actividades para niños y adultos<br />* Pintacaritas y Figuras en Bombas<br />* Juego de Rana<br />* Torneo de futbol<br />* Concurso de baile<br />* Juegos tradicionales callejeros</p>\n<p>Una oportunidad más para volver a disfrutar los sabores Colombianos en Pittsburgh.</p>","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("20","2014-05-28 23:11:41","1","2014-06-10 16:40:55","1","1","Join us for \"Karaoke Night\" on June 7 at Chicken Latino","join-us-karaoke-night-june-7-chicken-latino","0","0","past","2014-05-28 00:00:00",NULL,NULL,"<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d1518.024385605631!2d-79.98374415344232!3d40.45205750261793!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834f3dcdea56e3f%3A0xa77d4c53b3b757ca!2sChicken+Latino!5e0!3m2!1sen!2sus!4v1401333064378\" width=\"800\" height=\"600\" frameborder=\"0\" style=\"border:0\"></iframe>","0","0","<p>Colombia en Pittsburgh los invita a una noche de Karoke el próximo 7 de junio. Habrá cerveza y comida para la venta. El valor de la entrada (que incluye un trago de aguardiente) está destinado a la recolección de fondos para la conmemoracion de la independencia el 20 de julio. Los esperamos!</p>\n<p><strong>Junio 7, 2014</strong><br />6:00 - 10:00 pm<br />Valor de la entrada: $5 dólares</p>\n<p></p>\n<p>Colombia en Pittsburgh invites you to a night of Karaoke on June 7. There will be beer and food for sale. The entrance fee (which includes an Aguardiente shot) will contribute to fund the conmemoracion of the Colombian Independence on July 20. We look forward to seeing you there!</p>\n<p><strong>June 7, 2014</strong><br />6:00 - 10:00 pm<br />Entrance fee: $5 dollars</p>\n<p></p>","","","Learn more","0","","");
