INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("22","2014-06-26 11:42:09","1","2014-06-30 12:32:19","1","1","Colombia vs Uruguay","colombia-vs-uruguay","0","0","past","2014-06-28 00:00:00",NULL,NULL,"<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d189.8054064492159!2d-79.9229064576961!3d40.433512005320765!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0xdcc6a961b8f6bd29!2sCuzamil+Restaurante+Mexicano!5e0!3m2!1sen!2sus!4v1403797304364\" width=\"800\" height=\"600\" frameborder=\"0\" style=\"border:0\"></iframe>","0","0","<p>Colombia en Pittsburgh los invita al partido de esta sábado esta vez en Cozumel Mexican Restaurante... Los esperamos!!</p>\n<p>Saturday, June 28, 3:30pm</p>\n<p></p>","","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("23","2014-07-03 21:26:53","1","2014-07-06 15:52:00","1","1","Colombia vs Brazil","colombia-vs-brazil","0","0","past","2014-07-04 00:00:00",NULL,NULL,"<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d3037.1043596547865!2d-79.964471!3d40.42868800000001!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834f177ccbaf711%3A0x7518484a0f0c1d19!2sHofbr%C3%A4uhaus+Pittsburgh!5e0!3m2!1sen!2sus!4v1404437175803\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\"></iframe>","0","0","<p>Everything is ready for the next game COLOMBIA vs BRAZIL! Video, audio, and enough space for everyone!!!</p>\r\n<p>Friday, July 4th at 3:30 p.m.<br />Hofbräuhaus Pittsburgh<br />2705 South Water St.<br />Pittsburgh, PA 15203</p>\r\n<p><span style=\"font-family: Times New Roman; font-size: medium;\" face=\"Times New Roman\" size=\"3\"> </span></p>\r\n<p><span style=\"font-family: Times New Roman; font-size: medium;\" face=\"Times New Roman\" size=\"3\"> </span></p>\r\n<p></p>","","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("24","2014-07-06 15:54:07","1","2017-07-05 15:32:08","1","2","Gracias Colombia!","gracias-colombia","0","0","past","2014-07-06 00:00:00","","","","0","0","<p>Thanks to all for following our events and for your support. Our goal is to keep our Colombian families together and even though we are miles away from our home country, made you feel as home. Definitely, we can say out loud that there is a... big Colombia group in the Burgh!</p>\n<p>Thank you too to the restaurants that opened their doors during our games very kindly to our Colombian families. Thanks Chicken Latino, El Patron Mexican Grill, Cuzamil Restaurante Mexicano and Hofbrauhaus Pittsburgh. You helped us write history in Pittsburgh during this World Cup 2014!</p>\n<p>But, this is not all my dear friends, we have more events for you! Come and celebrate with us el \"Dia de la Independencia\" on Sunday July 20, 2014 From 1 - 5 PM. Highland Park - Elm Grove Shelter. We are going to have music, zumba and delicious food; more details coming soon...</p>\n<p>All of this is not worth it without your assistance. So, please mark your calendars!! Colombia en Pittsburgh as always would be delighted to seeing all of you there!</p>\n<p>VIVA COLOMBIA!!!</p>","","","Learn more","0","","");
