INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("31","2015-03-03 13:07:59","2","2015-05-19 08:26:18","2","1","Tarde de bolos familiar - Domingo 12 de abril 12","tarde-de-bolos-familiar-domingo-12-de-abril-12","0","0","past","2015-03-05 00:00:00",NULL,NULL,"<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d3037.0811615198313!2d-79.92232349999999!3d40.42920169999999!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834f1fce32502b1%3A0x6fada3db187cc4b5!2s5844+Forward+Ave%2C+Pittsburgh%2C+PA+15217!5e0!3m2!1sen!2sus!4v1425414684939\" width=\"800\" height=\"600\" frameborder=\"0\" style=\"border:0\"></iframe>","0","0","<p><strong>Domingo 12 de abril 12<br />1 - 4 pm</strong></p>\n<p>5844 Forward Avenue<br />Pittsburgh PA 15217</p>\n<p>Los invitamos a compartir una tarde en familia jugando bolos!<br />Hemos reservado varias lineas a una tarifa especial de $8 dólares por persona por hora (incluye zapatos).<br /><br />En caso de que puedan acompañarnos por favor confirmen su asistencia <a href=\"https://www.facebook.com/#!/events/341885632681774/\">aquí. </a><br />Los esperamos!</p>\n<p>*edad mínima para jugar: 3 años en adelante</p>","","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("32","2015-03-03 13:12:26","2","2016-02-24 09:58:25","2","1","Asamblea General de Colombia en Pittsburgh - Lunes 30 de marzo","asamblea-general-de-colombia-en-pittsburgh-lunes-30-de-marzo","0","0","past","2015-03-05 00:00:00","","","<iframe src=\"https://www.google.com/maps/embed?pb=!1m27!1m12!1m3!1d1518.2587134121254!2d-79.95370202137364!3d40.44168339183649!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!4m12!1i0!3e6!4m3!3m2!1d40.445938999999996!2d-79.91314299999999!4m5!1s0x8834f22849bed815%3A0xdb7d9b76035d27e4!2sWesley+W.+Posvar+Hall+230+South+Bouquet+Street!3m2!1d40.441643!2d-79.953818!5e0!3m2!1sen!2sus!4v1425414782349\" width=\"800\" height=\"600\" frameborder=\"0\" style=\"border:0\"></iframe>","0","0","<h5>Lunes 30 de marzo<br />6:30 pm</h5>\n<p><strong>Salon 4217 Posvar Hall<br />University of Pittsburgh</strong></p>\n<p>Asamblea General de Colombia en Pittsburgh</p>\n<p>Su presencia es muy importante para que la organización sea exitosa. Nos interesa su opinión y participación.<br />Los esperamos!</p>","","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("33","2015-03-29 23:03:52","1","2015-03-29 23:03:52","1","1","Consulado Móvil de Colombia en Newark visitará Pittsburgh","consulado-movil-de-colombia-en-newark-visitara-pittsburgh","0","0","past","2014-08-13 00:00:00",NULL,NULL,"","0","0","<p>El Consulado Móvil de Colombia en Newark visitará Pittsburgh el día<strong> 4 de octubre.</strong> Muchas gracias a todos los que completaron el formulario contándonos que servicios necesitarán. </p>\n<p>Recuerden que la forma de pago es <em>MONEY ORDER.</em> También, para asegurar que los documentos lleguen con prontitud a su destino, asegúrense de llevar consigo CORREO CERTIFICADO PREPAGADO (USPS, UPS or Fedex).</p>","<p>Para informacion relacionada con los requisitos para los trámites, por favor tengan en cuenta la información que encuentran en la<a href=\"http://newark.consulado.gov.co/tramites_servicios/tramites_exterior\"> página</a> del consulado.</p>\n<p><strong>Dónde</strong><br />University of Pittsburgh<br />Wesley W. Posvar Hall<br />Salón: 4130<br />230 South Bouquet Street<br />Pittsburgh, PA 15260</p>\n<p><strong>Cuándo</strong><br />Sábado 4 de octubre<br />9:00 am – 1:00 pm</p>\n<p class=\"divider\"><span style=\"line-height: 1.5;\">The Colombian Consulate will visit Pittsburgh on October 4. Thank you very much for completing the form lettins know what services you will need. </span></p>\n<p>For information related with the requirements for each service, please keep in mind the information that you can find on the consulate <a href=\"http://newark.consulado.gov.co/tramites_servicios/tramites_exterior\">webpage</a>.</p>\n<p>Also, to make sure the documents arrive to you promptly, please bring a CERTIFIED PRE-PAID ENVELOPE (USPS, UPS or Fedex)</p>\n<p><strong>Where</strong><br />University of Pittsburgh<br />Wesley W. Posvar Hall<br />Room: 4130<br />230 South Bouquet Street<br />Pittsburgh, PA 15260</p>\n<p><strong>When</strong><br />Saturday 4 de octubre<br />9:00 am – 1:00 pm</p>\n<h4 class=\"divider\">Precios</h4>\n<table>\n<tbody>\n<tr>\n<td class=\"col1\">Pasaporte ordinario</td>\n<td class=\"col2\">$132.00</td>\n</tr>\n<tr>\n<td class=\"col1\">Pasaporte de emergencia</td>\n<td class=\"col2\">$112.00</td>\n</tr>\n<tr>\n<td class=\"col1\">Pasaporte ejecutivo</td>\n<td class=\"col2\">$201.00</td>\n</tr>\n<tr>\n<td class=\"col1\">Certificaciones</td>\n<td class=\"col2\">$40.00</td>\n</tr>\n<tr>\n<td class=\"col1\">Reconocimiento de firma, autenticaciones</td>\n<td class=\"col2\">$23.00</td>\n</tr>\n<tr>\n<td class=\"col1\">Reconocimiento de firma de salida de menores</td>\n<td class=\"col2\">$23.00</td>\n</tr>\n<tr>\n<td class=\"col1\">Autenticación copias, fotocopias</td>\n<td class=\"col2\">$27.00</td>\n</tr>\n<tr>\n<td class=\"col1\">Duplicados de cédula de ciudadanía</td>\n<td class=\"col2\">$35.40</td>\n</tr>\n<tr>\n<td class=\"col1\">Renovacion de cédulas</td>\n<td class=\"col2\">$ -</td>\n</tr>\n<tr>\n<td class=\"col1\">Cédulas primera vez</td>\n<td class=\"col2\">$ -</td>\n</tr>\n<tr>\n<td class=\"col1\">Supervivencias</td>\n<td class=\"col2\">$ -</td>\n</tr>\n<tr>\n<td class=\"col1\">Registros civiles (Nacimiento, Matrimonio y Defunción)</td>\n<td class=\"col2\">$ -</td>\n</tr>\n</tbody>\n</table>","","Learn more","1","Copy Of ","<div id=\"wufoo-z7x4m1\">\n</div>\n<script type=\"text/javascript\">var z7x4m1;(function(d, t) {\nvar s = d.createElement(t), options = {\n\'userName\':\'colombiaenpittsburgh\', \n\'formHash\':\'z7x4m1\', \n\'autoResize\':true,\n\'height\':\'1292\',\n\'async\':true,\n\'header\':\'hide\', \n\'ssl\':true};\ns.src = (\'https:\' == d.location.protocol ? \'https://\' : \'http://\') + \'wufoo.com/scripts/embed/form.js\';\ns.onload = s.onreadystatechange = function() {\nvar rs = this.readyState; if (rs) if (rs != \'complete\') if (rs != \'loaded\') return;\ntry { z7x4m1 = new WufooForm();z7x4m1.initialize(options);z7x4m1.display(); } catch (e) {}};\nvar scr = d.getElementsByTagName(t)[0], par = scr.parentNode; par.insertBefore(s, scr);\n})(document, \'script\');</script>\n");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("34","2015-03-29 23:05:41","1","2017-07-28 09:17:44","1","1","Consulado Móvil de Colombia en Newark visitará Pittsburgh el día 1 de agosto 2015","consulado-movil-de-colombia-en-newark-visitara-pittsburgh-el-dia-1-de-agosto-2015","0","0","past","2015-08-01 00:00:00","9:00 am – 1:00 pm","Wightman School<br/>\n5604 Solway Street <br/>\nPittsburgh, PA 15217","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d594.9009298612584!2d-79.9271408164566!3d40.44265534641893!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0000000000000000%3A0x6fabd43b5f03aeb2!2sWightman+School+Community+Building!5e0!3m2!1sen!2sus!4v1455644158235\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>","0","0","<p>El Consulado Móvil de Colombia en Newark visitará Pittsburgh el día 1 de agosto 2015.</p>\n<p>Encuentra información relacionada con los servicios que se prestarán en el <a href=\"/admin/uploads/requisitos-consulado-y-costos-de-tramites-a-2015.pdf\">documento adjunto</a>. Si tienen preguntas o inquietudes, por favor visiten la página del consulado para que sean resueltas.</p>\n<p>Adicionalmente, para mayor agilidad en la solicitud de pasaporte, <a href=\"http://newark.consulado.gov.co/\" target=\"_blank\">regístrese electrónicamente con la información de su cédula.</a></p>\n<p>También, para asegurar que los documentos lleguen con prontitud a su destino, asegúrense de llevar consigo correo certificado prepagado (USPS priority mail, UPS or Fedex)</p>\n<p><span style=\"line-height: 1.5;\">Forma de pago:<br /></span>Money order</p>\n<p>---</p>\n<p>The Colombian Consulate will visit Pittsburgh on August 1, 2015.</p>\n<p>You will find information related with the services that will be provided in the<a href=\"/admin/uploads/requisitos-consulado-y-costos-de-tramites-a-2015.pdf\"> attached document</a>. If you have any questions, please visit the consulate webpage to obtain an answer.</p>\n<p>Additionally, to expedite the process of requesting your passport, <a href=\"http://newark.consulado.gov.co\" target=\"_blank\">register electronically with your cédula information</a>.</p>\n<p>Also, to make sure the documents arrive to you promptly, please bring a certified pre-paid envelope (USPS priority mail, UPS or Fedex)</p>\n<p><span style=\"line-height: 1.5;\">How to pay:<br /></span>Money order</p>\n<p></p>","","","Learn more","0","","<div id=\"wufoo-z7x4m1\">\n</div>\n<script type=\"text/javascript\">var z7x4m1;(function(d, t) {\nvar s = d.createElement(t), options = {\n\'userName\':\'colombiaenpittsburgh\', \n\'formHash\':\'z7x4m1\', \n\'autoResize\':true,\n\'height\':\'1292\',\n\'async\':true,\n\'header\':\'hide\', \n\'ssl\':true};\ns.src = (\'https:\' == d.location.protocol ? \'https://\' : \'http://\') + \'wufoo.com/scripts/embed/form.js\';\ns.onload = s.onreadystatechange = function() {\nvar rs = this.readyState; if (rs) if (rs != \'complete\') if (rs != \'loaded\') return;\ntry { z7x4m1 = new WufooForm();z7x4m1.initialize(options);z7x4m1.display(); } catch (e) {}};\nvar scr = d.getElementsByTagName(t)[0], par = scr.parentNode; par.insertBefore(s, scr);\n})(document, \'script\');</script>\n");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("36","2015-06-08 10:58:49","1","2016-04-18 19:47:27","1","1","Join us for \"20 de Julio 2014\" in Highland Park","join-us-20-de-julio-2014-highland-park","0","0","past","2014-07-20 00:00:00","","","<iframe width=\"600\" height=\"450\" frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\" src=\"https://maps.google.com/maps/ms?ie=UTF8&amp;oe=UTF8&amp;msa=0&amp;msid=214392894137482152948.0004729daba965ee4a02e&amp;t=m&amp;ll=40.482993,-79.910946&amp;spn=0.014689,0.025706&amp;z=15&amp;iwloc=000472b11fdc66211071d&amp;output=embed\"></iframe><br /><small>View <a href=\"https://maps.google.com/maps/ms?ie=UTF8&amp;oe=UTF8&amp;msa=0&amp;msid=214392894137482152948.0004729daba965ee4a02e&amp;t=m&amp;ll=40.482993,-79.910946&amp;spn=0.014689,0.025706&amp;z=15&amp;iwloc=000472b11fdc66211071d&amp;source=embed\" style=\"color:#0000FF;text-align:left\">Highland Park</a> in a larger map</small>","0","0","<h4><strong></strong>Sunday, July 20 2014</h4>\n<p><strong>12pm / Misa en Espanol / St. Regis Parish<br /></strong>El domingo 20 de Julio día de la Independencia de Colombia se celebrará la misa en español por las intenciones de todos los Colombianos en especial las intenciones de los Colombianos en Pittsburgh. </p>\n<p><strong>1pm–5pm / Community Celebration<br /></strong>Highland Park<br />Elm Grove Shelter</p>\n<p><em>Todos están invitados!</em></p>\n<p><em><img src=\"/admin/uploads/sponsors.jpg\" width=\"429\" height=\"66\" /></em></p>","","","Learn more","0","Copy Of ","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("37","2015-06-15 10:35:46","1","2016-02-16 12:34:23","1","1","Harpist, Sergio-Nicolás Aguirre, to perform on Wednesday June 17, 2015","harpist-sergio-nicolas-aguirre-perform-wednesday-june-17-2015","0","0","past","2015-06-17 00:00:00","Time and location is noted below","","","0","0","<p>Sergio Nicolas Aguirre Gomez is a young Colombian harpist in the traditional arpa llanera style of Venezuela and Colombia. He is the son of Hildo Ariel Aguirre Daza, renowned harpist, composer, teacher, and founder of a music school, Academia Llano y Joropo, in Bogotá.</p>\n<p>There will be two performances:</p>","<p><strong>Wednesday, June 17, 2015 @ 1pm</strong><br /><strong>AJ\'s Burger &amp; Peruvian Rotisserie Chicken<br /></strong>422 Semple Street<br />Pittsburgh, PA 15213<br />412-688-8880</p>\n<p></p>\n<p><strong>Wednesday, June 17, 2015 @ 6 - 9pm</strong><br /><strong>Adolfo\'s Restaurant</strong><br />4770 Liberty Avenue<br />Pittsburgh, PA 15224<br />412-681-0505</p>\n<p></p>\n<p><strong>Harping for Harmony Foundation</strong> is a 501c3 exempt charity in the State of West Virginia, on the web at <a href=\"http://www.harpingforharmony.org\">harpingforharmony.org</a>. It\'s mission is to promote harmony and community, locally and globally, through harp music.</p>","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("38","2015-06-27 10:20:30","2","2016-02-16 12:33:43","1","1","Yoga para adultos y niños","yoga-para-adultos-y-ninos","0","0","past","2015-06-28 00:00:00","11 am","Highland Park","","0","0","<p>Por favor no olvide dejar su propina. Gracias!</p>\n<p>Clase de Yoga para niños y adultos que estará a cargo de Natalia Gómez Pinzón, formada en Costa Rica, Francia y Colombia, bailarina coreógrafa educadora,  certificada en Pilates y Yoga Kids, actualmente se encuentra en Pittsburgh haciendo sus estudios en Educación Somática en Body Mind Movement.</p>\n<p>Su trabajo se enfoca en aportar desde su experiencia la conciencia fisica mental, la alineación, el soporte, la estabilidad y la movilidad creando un vinculo mas cercano con tu propio cuerpo y con el otro o los otros individuos y con el mundo alrededor.</p>","","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("39","2015-09-14 13:30:53","2","2016-02-15 11:21:44","1","1","Fiesta de los niños","fiesta-de-los-ninos","0","0","past","2015-11-01 00:00:00","3:30pm - 7:00pm","250 South Pacific Avenue<br/>\nPittsburgh PA 15224","","0","1","","<p>Los invitamos especialmente a celebrar el día de los niños con nosotros !</p>\n<p>Habrá comida para la venta y también actividades para los niños.</p>\n<p>Si no han confirmado su asistencia, amablemente les pedimos que completen el formulario que se encuentra a continuación. Muchas gracias!</p>\n<p>Los esperamos!</p>\n<p>Colombia en Pittsburgh</p>\n<p>PD. En caso de que alguien esté interesado en ofrecer sus productos para la venta durante el evento, le pedimos se comuniquenantes del miércoles 28 de octubre a este mismo correo.</p>","","Learn more","0","Confirma tu asistencia","<div id=\"wufoo-rn93aii1gkry1f\">\nFill out my <a href=\"https://colombiaenpittsburgh.wufoo.com/forms/rn93aii1gkry1f\">online form</a>.\n</div>\n<script type=\"text/javascript\">var rn93aii1gkry1f;(function(d, t) {\nvar s = d.createElement(t), options = {\n\'userName\':\'colombiaenpittsburgh\',\n\'formHash\':\'rn93aii1gkry1f\',\n\'autoResize\':true,\n\'height\':\'2078\',\n\'async\':true,\n\'host\':\'wufoo.com\',\n\'header\':\'hide\',\n\'ssl\':true};\ns.src = (\'https:\' == d.location.protocol ? \'https://\' : \'http://\') + \'www.wufoo.com/scripts/embed/form.js\';\ns.onload = s.onreadystatechange = function() {\nvar rs = this.readyState; if (rs) if (rs != \'complete\') if (rs != \'loaded\') return;\ntry { rn93aii1gkry1f = new WufooForm();rn93aii1gkry1f.initialize(options);rn93aii1gkry1f.display(); } catch (e) {}};\nvar scr = d.getElementsByTagName(t)[0], par = scr.parentNode; par.insertBefore(s, scr);\n})(document, \'script\');</script>\n");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("40","2015-10-30 14:33:19","1","2017-07-05 15:29:48","1","2","The Colombian Spot opens it\'s doors in the Strip District","colombian-spot-opens-s-doors-strip-district","0","0","past","2015-10-30 00:00:00","","","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d583.9133069031822!2d-79.9809693339278!3d40.45371279074309!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0000000000000000%3A0xa909e99095638ac8!2sPittsburgh+Public+Market!5e0!3m2!1sen!2sus!4v1446229956555\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>","0","0","<p>Featuring a variety of delicious Colombian foods, be sure to visit The Colombian Spot. Located inside of the Public Market in the Strip District at 2401 Penn Avenue, Pittsburgh PA 15222.</p>\n<p><strong><a href=\"https://www.facebook.com/The-Colombian-Spot-1678641349021986/\">Visit them on Facebook</a></strong></p>","","","Learn more","0","","");
