n\'height\':\'2139\',\n\'async\':true,\n\'host\':\'wufoo.com\',\n\'header\':\'hide\',\n\'ssl\':true};\ns.src = (\'https:\' == d.location.protocol ? \'https://\' : \'http://\') + \'www.wufoo.com/scripts/embed/form.js\';\ns.onload = s.onreadystatechange = function() {\nvar rs = this.readyState; if (rs) if (rs != \'complete\') if (rs != \'loaded\') return;\ntry { rn93aii1gkry1f = new WufooForm();rn93aii1gkry1f.initialize(options);rn93aii1gkry1f.display(); } catch (e) {}};\nvar scr = d.getElementsByTagName(t)[0], par = scr.parentNode; par.insertBefore(s, scr);\n})(document, \'script\');</script>\n");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("44","2016-02-15 10:27:00","1","2016-04-26 08:51:56","2","1","Good Home Project: Good Computers Finding Good Homes","good-home-project-good-computers-finding-good-homes","0","0","past","2016-02-27 00:00:00","10:00am - 2:00pm","St. Regis Parish<br/>\n3235 Parkview Ave<br/>\nPittsburgh, PA 15213<br/>\nwww.stregisparish.org<br/>\n(412) 681-9365","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3037.024586338582!2d-79.95553598381284!3d40.430454479363554!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834f18553d4d28b%3A0xed46f4dd4c77c97c!2sSt+Regis+Parish!5e0!3m2!1sen!2sus!4v1455549988284\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>","0","1","<p>Con la ayuda y apoyo de Computer Reach, una asociación sin animo de lucro que recondiciona computadores usados, Colombia en Pittsburgh estará distribuyendo mas de 200 computares Apple G3 a familias de la comunidad latina totalmente gratis.</p>\n<p>El único requisito es que la personas que reciban el computador estén de acuerdo en participar en un estudio de como usan el computador.</p>\n<p>Para agilizar el proceso de entrega, les sugerimos que se registren en: <a href=\"http://www.computerreach.org/good-home-project/\">http://www.computerreach.org/good-home-project/</a></p>","<p>-------</p>\n<p>With the help and support of Computer Reach, a non-profit that refurbish used computers, Colombia en Pittsburgh will be distributing more than 200 computers Apple G3 to families in the Latino community.</p>\n<p>The only requirement is that the persons who receive the computer agree to be in a research study on how they will be using this free computer.</p>\n<p>To make the delivery process faster, we suggest that do you register online at: <a href=\"http://www.computerreach.org/good-home-project/\">http://www.computerreach.org/good-home-project/</a></p>\n<p>Please help us to share this information! Thanks</p>","","","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("45","2016-02-24 09:58:27","2","2016-02-24 19:58:42","2","1","Asamblea General de Colombia en Pittsburgh","asamblea-general-de-colombia-en-pittsburgh","0","0","past","2016-02-29 00:00:00","","","<iframe src=\"https://www.google.com/maps/embed?pb=!1m27!1m12!1m3!1d1518.2587134121254!2d-79.95370202137364!3d40.44168339183649!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!4m12!1i0!3e6!4m3!3m2!1d40.445938999999996!2d-79.91314299999999!4m5!1s0x8834f22849bed815%3A0xdb7d9b76035d27e4!2sWesley+W.+Posvar+Hall+230+South+Bouquet+Street!3m2!1d40.441643!2d-79.953818!5e0!3m2!1sen!2sus!4v1425414782349\" width=\"800\" height=\"600\" frameborder=\"0\" style=\"border:0\"></iframe>","0","0","<h5><br />6:30 pm - 8:30 pm</h5>\n<p><strong>Salon 4217 Posvar Hall<br />University of Pittsburgh</strong></p>\n<p>Asamblea General de Colombia en Pittsburgh</p>\n<p>Su presencia es muy importante para que la organización sea exitosa. Nos interesa su opinión y participación.<br />Los esperamos!</p>","","","Learn more","0","2016 Asamble General","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("46","2016-04-18 19:41:41","1","2016-05-26 09:59:21","2","1","Consulado Móvil de Colombia en Newark visitará Pittsburgh el día 7 de mayo 2016","consulado-movil-de-colombia-en-newark-visitara-pittsburgh-el-dia-7-de-mayo-2016","0","0","past","2016-05-07 00:00:00","9:00 am – 2:00 pm","Wightman School<br/>\n5604 Solway Street <br/>\nPittsburgh, PA 15217","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d594.9009298612584!2d-79.9271408164566!3d40.44265534641893!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0000000000000000%3A0x6fabd43b5f03aeb2!2sWightman+School+Community+Building!5e0!3m2!1sen!2sus!4v1455644158235\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>","0","0","<p>El Consulado Móvil de Colombia en Newark visitará Pittsburgh el día 7 de mayo 2016.</p>\n<!--<p>Encuentra información relacionada con los servicios que se prestarán en el <a href=\"/admin/uploads/requisitos-consulado-y-costos-de-tramites-a-2015.pdf\">documento adjunto</a>. Si tienen preguntas o inquietudes, por favor visiten la página del consulado para que sean resueltas.</p>\n<p>Adicionalmente, para mayor agilidad en la solicitud de pasaporte, <a href=\"http://newark.consulado.gov.co/\" target=\"_blank\">regístrese electrónicamente con la información de su cédula.</a></p>\n-->\n<p>Para asegurar que los documentos lleguen con prontitud a su destino, asegúrense de llevar consigo correo certificado prepagado (USPS priority mail, UPS or Fedex)</p>\n<p><span style=\"line-height: 1.5;\">Forma de pago:<br /></span>Money order</p>\n<p>---</p>\n<p>The Colombian Consulate will visit Pittsburgh on May 7, 2016.</p>\n<!--\n<p>You will find information related with the services that will be provided in the<a href=\"/admin/uploads/requisitos-consulado-y-costos-de-tramites-a-2015.pdf\"> attached document</a>. If you have any questions, please visit the consulate webpage to obtain an answer.</p>\n<p>Additionally, to expedite the process of requesting your passport, <a href=\"http://newark.consulado.gov.co\" target=\"_blank\">register electronically with your cédula information</a>.</p>\n-->\n<p>To make sure the documents arrive to you promptly, please bring a certified pre-paid envelope (USPS priority mail, UPS or Fedex)</p>\n<p><span style=\"line-height: 1.5;\">How to pay:<br /></span>Money order</p>\n<p></p>","<p><object style=\"width: 953px;\" width=\"320\" height=\"868\" data=\"/admin/uploads/cmovil-pittsburgh-2016.png\" type=\"application/x-shockwave-flash\"><param name=\"src\" value=\"/admin/uploads/cmovil-pittsburgh-2016.png\" /></object></p>","","Learn more","1","Copy Of ","<div id=\"wufoo-z7x4m1\">\n</div>\n<script type=\"text/javascript\">var z7x4m1;(function(d, t) {\nvar s = d.createElement(t), options = {\n\'userName\':\'colombiaenpittsburgh\', \n\'formHash\':\'z7x4m1\', \n\'autoResize\':true,\n\'height\':\'1292\',\n\'async\':true,\n\'header\':\'hide\', \n\'ssl\':true};\ns.src = (\'https:\' == d.location.protocol ? \'https://\' : \'http://\') + \'wufoo.com/scripts/embed/form.js\';\ns.onload = s.onreadystatechange = function() {\nvar rs = this.readyState; if (rs) if (rs != \'complete\') if (rs != \'loaded\') return;\ntry { z7x4m1 = new WufooForm();z7x4m1.initialize(options);z7x4m1.display(); } catch (e) {}};\nvar scr = d.getElementsByTagName(t)[0], par = scr.parentNode; par.insertBefore(s, scr);\n})(document, \'script\');</script>\n");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("47","2016-04-26 08:52:00","2","2016-04-26 11:58:31","2","1","Good Home Project: Good Computers Finding Good Homes","good-home-project-good-computers-finding-good-homes-1","0","0","past","2016-04-30 00:00:00","9:00am - 1:00pm","The Center for Community Empowerment<br/>\n1420 Dogwood Lane,<br/>\nYoungstown, OH 44505","","0","1","<p>Con la ayuda y apoyo de Computer Reach, una asociación sin ánimo de lucro que recondiciona computadores usados, Colombia en Pittsburgh estará distribuyendo más de 120 computadores Apple G3 a familias de la comunidad latina totalmente gratis.</p>\n<p>El único requisito es que la personas que reciban el computador estén de acuerdo en participar en un estudio de cómo usan el computador.</p>\n<p>Para agilizar el proceso de entrega, les sugerimos que se registren en: <a href=\"http://www.computerreach.org/good-home-project/\">http://www.computerreach.org/good-home-project/</a></p>","<p>-------</p>\n<p>With the help and support of Computer Reach, a non-profit that refurbish used computers, Colombia en Pittsburgh will be distributing more than 120 computers Apple G3 to families in the Latino community.</p>\n<p>The only requirement is that the persons who receive the computer agree to be in a research study on how they will be using this free computer.</p>\n<p>To make the delivery process faster, we suggest that do you register online at: <a href=\"http://www.computerreach.org/good-home-project/\">http://www.computerreach.org/good-home-project/</a></p>\n<p>Please help us to share this information! Thanks</p>","","","0","Copy Of ","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("48","2016-05-26 10:01:34","2","2016-06-21 12:15:18","2","1","Copa America Centenario","copa-america-centenario","0","0","past","2016-06-03 00:00:00","8:30 pm","Tana Ethiopian Cuisine<br/>\n5929 Baum Blvd, Pittsburgh, Pennsylvania 15206","","0","0","<p>Copa America Centenario</p>\n<p>Tana Ethiopian Cuisine<br />5929 Baum Blvd, Pittsburgh, Pennsylvania 15206<br />8:30 pm</p>\n<p>DJ - Mateo Mattos</p>\n<p></p>","<p>Copa America Centenario 8:30 pm</p>\n<p>COLOMBIA VS UNITED STATES  TO OPEN \"COPA AMERICA CENTENARIO\" <br />Now is the Time... <br />To Scream <br />To Wave Your Flag <br />To Wear Your Colors <br />Now is the Time... <br />TO GET TOGETHER!</p>\n<p>We have everything ready for you:</p>\n<p>A big screen to watch the game <br />Colombian music to celebrate. <br />Food and drinks for sale.</p>\n<p>We are only missing the most important: YOU!!</p>\n<p>Please bring your whistles, maracas and tambores.</p>\n<p>TANA Restaurant is open exclusively for this event after 9:00 p.m. <br />We can have more than 80 people!! DONT MISS IT!!</p>","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("49","2016-06-07 18:43:11","2","2016-07-13 08:28:58","2","1","Desfile Bicentenario","desfile-bicentenario","0","0","past","2016-07-09 00:00:00","10:00 am","","","0","0","","<p>Colombia en Pittsburgh será parte del desfile para conmemorar el bicentenario de Pittsburgh.</p>\n<p>Estamos organizando una representación autóctona de nuestra tierra, por favor acompáñennos!   <br />Colombia en Pittsburgh somos todos!</p>\n<p>Lugar de encuentro: Liberty Av &amp; 11th st. <br />Los esperamos!</p>","","Learn more","0","","");
