INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("51","2016-07-06 10:36:05","2","2016-07-26 10:49:33","1","1","Pre-independence Colombian party!","pre-independence-colombian-party","0","0","past","2016-07-22 00:00:00","10:00 pm - 1:30 am","Bar Marco<br/>\n2216 Penn Ave. <br/>\nPittsburgh PA 15222","","0","0","<p><a href=\"https://www.picatic.com/PreIndependenceColombianParty\">Tickets are $15 in advance</a>, and $20 at the door.<br />Doors open at 10:00 PM.</p>\n<p>\"All proceeds will support the activities of Colombia en Pittsburgh\"</p>","<p>All night of Latin music and dancing with our special guess Zafarrancho directly from Colombia and  DJ Juan Diego.</p>\n<p>Zafarrancho is a Colombian group with 6 years of experience, which appears in the music scene with the purpose of exalting the national folklore and make it force through its merger with young and contemporary sounds, accompanied by an impeccable staging full dance and fun, plus improvisation because the color, the party and diversity are the main elements when filled with tropical magic \"the criollo show more crazy of the world\"</p>","","Learn more","0","","");
