INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("53","2016-07-26 10:52:07","1","2020-05-10 10:33:14","1","3","Denos por favor su opinión","denos-por-favor-su-opinion-respecto-los-eventos-de-conmemoracion-de-la-independencia-de-colombia","0","0","past","2016-07-26 00:00:00","","","","0","0","<p>Denos por favor su opinión respecto a los eventos de conmemoración de la Independencia de Colombia</p>\n<p>En nombre de Colombia en Pittsburgh, queremos agradecer su apoyo durante la conmemoración de nuestra independencia! Esperamos que hayan disfrutado la celebración!</p>\n<p>Muchas gracias!</p>","","","Learn more","0","","<div id=\"wufoo-z1p04x341e0lpyo\">\n</div>\n<script type=\"text/javascript\">var z1p04x341e0lpyo;(function(d, t) {\nvar s = d.createElement(t), options = {\n\'userName\':\'mizrahi\',\n\'formHash\':\'z1p04x341e0lpyo\',\n\'autoResize\':true,\n\'height\':\'507\',\n\'async\':true,\n\'host\':\'wufoo.com\',\n\'header\':\'hide\',\n\'ssl\':true};\ns.src = (\'https:\' == d.location.protocol ? \'https://\' : \'http://\') + \'www.wufoo.com/scripts/embed/form.js\';\ns.onload = s.onreadystatechange = function() {\nvar rs = this.readyState; if (rs) if (rs != \'complete\') if (rs != \'loaded\') return;\ntry { z1p04x341e0lpyo = new WufooForm();z1p04x341e0lpyo.initialize(options);z1p04x341e0lpyo.display(); } catch (e) {}};\nvar scr = d.getElementsByTagName(t)[0], par = scr.parentNode; par.insertBefore(s, scr);\n})(document, \'script\');</script>");
