INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("55","2016-09-21 17:13:30","1","2017-10-03 08:53:40","1","1","Fiesta de Halloween 2016","fiesta-de-halloween-2016","0","0","past","2016-10-29 00:00:00","10pm - 2am","Tana Ethiopian Cuisine<br/>\n5929 Baum Blvd<br/>\nPittsburgh, Pennsylvania 15206","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3035.6612720470557!2d-79.92909888460275!3d40.46063347936005!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834f273a7f5ff0b%3A0x36c19fddbb9a6d32!2s5929+Baum+Blvd%2C+Pittsburgh%2C+PA+15206!5e0!3m2!1sen!2sus!4v1474492346724\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>","0","0","<p>Entrada: $5<br />DJ Mateos Mattos</p>\n<p>Custome Required!</p>","","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("56","2016-11-18 11:24:08","2","2016-11-28 14:32:38","2","1","Acción de gracias","accion-de-gracias","0","0","past","2016-11-19 00:00:00","1:00 pm","5756 Kentucky Ave<br/>\nPittsburgh, PA 15232","","0","1","<p>5756 Kentucky Ave<br />Pittsburgh, PA 15232</p>\n<p>Los invitamos a manifestar su agradecimiento haciendo una donación a quienes recien llegan a esta ciudad y necesitan de una mano amiga.</p>","<p><strong>¿Qué se necesita donar?</strong><br />Estamos recolectando ropa de invierno para mujeres, hombres, niños y niñas de todas las edades.</p>\n<ul>\n<li>chaquetas</li>\n<li>bufandas</li>\n<li>gorros y guantes</li>\n<li>medias gruesas...</li>\n<li>sacos de invierno</li>\n</ul>\n<p><strong>¿Qué más podemos donar si no tenemos ropa?</strong></p>\n<ul>\n<li>calentadores de bolsillos (son baratos en las tiendas)</li>\n<li>mantas y cobijas,</li>\n</ul>\n<p><strong>¿A quiénes se les darán estas donaciones?</strong></p>\n<ul>\n<li>En primer lugar, a las familias colombianas que recién llegaron a Pittsburgh.</li>\n<li>En segundo lugar, a las familias, estudiantes y trabajadores que ya viven acá y necesitan prepararse mejor para el invierno.</li>\n</ul>\n<p><strong>¿Puedo donar mi tiempo?</strong><br />¡Sí! necesitaremos manos extras para organizar las donaciones por categorias, Además carros para quienes pueden hacer la recolección y transporte (\"pick up\").?</p>\n<p>GRACIAS por este año 2016 lleno de amor, amistad y apoyo!</p>\n<p>Nota: Les pedimos por favor que todas las donaciones estén en buen estado. Gracias por su generosidad!</p>","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("57","2016-11-28 14:30:22","2","2017-02-06 08:04:32","2","1","Día de las velitas, viernes 9 de diciembre","dia-de-las-velitas-viernes-9-de-diciembre","0","0","past","2016-12-09 00:00:00","6:00 pm a 8:30 pm","St. Regis Parish<br/>\n3235 Parkview Ave.<br/>\nPittsburgh, Pennsylvania 15213","<iframe width=\"425\" height=\"350\" frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\" src=\"https://maps.google.com/maps?ie=UTF8&amp;fb=1&amp;gl=us&amp;ftid=0x8834f18553d4d28b:0x1de4bdc2959074e&amp;q=3235+Parkview+Ave,+Pittsburgh,+PA+15213&amp;hq=&amp;hnear=3235+Parkview+Ave,+Pittsburgh,+Pennsylvania+15213-4513&amp;ll=40.430464,-79.953369&amp;spn=0.009032,0.021093&amp;t=m&amp;z=14&amp;output=embed\"></iframe><br /><small><a href=\"https://maps.google.com/maps?ie=UTF8&amp;fb=1&amp;gl=us&amp;ftid=0x8834f18553d4d28b:0x1de4bdc2959074e&amp;q=3235+Parkview+Ave,+Pittsburgh,+PA+15213&amp;hq=&amp;hnear=3235+Parkview+Ave,+Pittsburgh,+Pennsylvania+15213-4513&amp;ll=40.430464,-79.953369&amp;spn=0.009032,0.021093&amp;t=m&amp;z=14&amp;source=embed\" style=\"color:#0000FF;text-align:left\">View Larger Map</a></small>","0","0","<p>Los invitamos a celebrar el Día de las Velitas con nosotros!<br />Será una noche llena de alegría y sorpresas para darle la bienvenida a esta linda época de navidad!</p>\n<p></p>","<p>Los esperamos!</p>\n<p></p>","","Learn more","1","Copy Of Copy Of Confirma tu asistencia","<div id=\"wufoo-rn93aii1gkry1f\">\nFill out my <a href=\"https://colombiaenpittsburgh.wufoo.com/forms/rn93aii1gkry1f\">online form</a>.\n</div>\n<script type=\"text/javascript\">var rn93aii1gkry1f;(function(d, t) {\nvar s = d.createElement(t), options = {\n\'userName\':\'colombiaenpittsburgh\',\n\'formHash\':\'rn93aii1gkry1f\',\n\'autoResize\':true,\n\'height\':\'2139\',\n\'async\':true,\n\'host\':\'wufoo.com\',\n\'header\':\'hide\',\n\'ssl\':true};\ns.src = (\'https:\' == d.location.protocol ? \'https://\' : \'http://\') + \'www.wufo