INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("59","2017-02-06 08:10:29","2","2017-05-19 08:11:25","2","1","Andrés 123","andres-123","0","0","past","2017-02-17 00:00:00","6:00 pm a 7:00 pm","Cathedral of Learning<br/>\nRoom 226<br/>\n4200 Fifth Ave<br/>\nPittsburgh, PA 15213<br/>\n<br/>\n","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3036.3977722660665!2d-79.95534348466297!3d40.44433226188435!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834f228a14899d7%3A0x9902f109ab045cc9!2s4200+Fifth+Ave%2C+Pittsburgh%2C+PA+15213!5e0!3m2!1sen!2sus!4v1486386766455\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>","0","0","<p>Colombia en Pittsburgh con el apoyo de Latin American Graduate Organization of Student (LAGOS) los invita a que le demos la bienvenida a 123 Andrés!<br />Artista colombiano ganador del GRAMMY Latino 2016 \"Mejor Album Para Niños\"</p>\n<p>http://www.123andres.com/</p>\n<p></p>","<p>Los esperamos!</p>\n<p></p>","","Learn more","1","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("60","2017-05-04 22:21:49","2","2020-05-10 14:37:04","1","1","Fundraising Night - Solidaridad con Mocoa","fundraising-night-solidaridad-con-mocoa","0","0","past","2017-05-11 00:00:00","4:00 pm - 8:00 pm","Panera Bread<br/>\n3401 Boulevard of the Allies<br/>\nPittsburgh PA 15213","","0","0","<p>In solidarity with the victims of the tragedy in Mocoa, Colombia en Pittsburgh invites you to participate in the event scheduled on May 11 in Paneral of Boulevard of the Allies.<br /><br />The funds raised will be sent to Colombia through the Red Cross on behalf of the Colombian community in Pittsburgh.</p>\n<p>* Please promote the Fundraising night with your friends *</p>\n<p></p>\n<p></p>","<p>Panera requires redemption of at least 20 flyers to make a donation. A printed flyer or an electronic version of the flyer on a mobile phone or tablet must be presented when ordering. The flyers cannot be passed out onsite the night of the event</p>\n<p>The donation given will be based on the amount of sales associated with the flyers. A tiered donation scale will be used:</p>\n<p>* 20-30 Flyers: 10% of net sales from redeemed flyers * 31-49 flyers: 15% of net sales from redeemed flyers * 50+ Flyers: 20% of net sales from redeemed flyers</p>\n<p></p>\n<p><img width=\"720\" height=\"960\" src=\"/admin/uploads/colombia_5_4_2017_2_39_00_pm_001.jpg\" /></p>","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("61","2017-05-19 08:10:53","2","2017-07-05 15:32:35","1","2","Planean sede de Universidad de Pittsburgh en Santander, Colombia","planean-sede-de-universidad-de-pittsburgh-en-santander-colombia","1","0","past","2012-07-01 00:00:00","","","","0","0","<p>Tras lograr el aval estatal para la puesta en marcha de la Fundación Universitaria de la FCV, el rector de la misma firma hoy convenio con su homólogo de la Universidad de Pittsburgh, para crear los programas a ofrecer.</p>\n<p></p>\n<p></p>","<p><a href=\"http://www.vanguardia.com/area-metropolitana/bucaramanga/398158-planean-sede-de-universidad-de-pittsburgh-en-santander\">Más información.</a></p>","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("62","2017-06-15 09:29:54","1","2020-05-10 14:34:53","1","1","Conmemoración del Día de la Independencia - 2018","20-de-julio-2018","0","0","past","2018-07-15 00:00:00","10:00 am - 4:00 pm","INSONMIA<br/>\n810 Brookline Blvd<br/>\nPittsburgh, PA 15226","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d343.5679680183404!2d-80.02002477546809!3d40.393327406846666!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834f73079b5f0a1%3A0x120bfd7137d8f375!2sInsomnia!5e0!3m2!1sen!2sus!4v1525652665887\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>","0","0","<p><strong><!--\n<h5>11:30 am / Misa en Español  <strong></strong></h5>\n<p>El sábado 18 de julio se celebrará la misa en español por las intenciones de todos los Colombianos en especial las intenciones de los Colombianos en Pittsburgh. La misa tendrá lugar en el mismo sitio y previa al resto de la celebración</p>\n--></strong></p>\n<p>Están cordialmente invitados con sus familiares y amigos a celebrar la independencia de Colombia.</p>\n<p>Una oportunidad más para reunirnos con nuestra familia y amigos y celebrar una de las fechas mas importantes de nuestra querida Colombia!!</p>\n<p>FECHA: Domingo, Julio 15, 2018<br />LUGAR: INSONMIA<br />810 Brookline Blvd, Pittsburgh, Pennsylvania 15226<br />HORA: 10:00 AM - 4:00 P.M</p>\n<p>Como estarémos en época del Mundial, se va a proyectar el juego de la final del mundial. Pronto estaremos compartiendo mas detalles de las actividades y grupos que se estarán presentando durante el día.</p>\n<p>No se lo pueden perder! GRATIS Y ABIERTO AL PÚBLICO!!!!</p>","","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("63","2017-06-15 10:10:03","1","2017-07-03 07:31:38","1","1","Pre Independence Colombian Party 2017","pre-independence-colombian-party-2017","0","0","past","2017-07-01 00:00:00","9 pm – 1:30 am","Bulgarian Macedonian Cultural Center<br/>\n449 W 8th Ave.<br/>\nHomestead, Pennsylvania 15120","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3038.320297208448!2d-79.92002168460452!3d40.40175467936685!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834ee2a20137357%3A0x10a31f85682c6da!2sBulgarian+Macedonian+National+Educational+and+Cultural+Center!5e0!3m2!1sen!2sus!4v1497535573515\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>","0","0","","<p></p>\n<p></p>\n<p></p>\n<p>You are invited to attend the Colombian Pre Independence Party. All night of Latin music and dancing with our special guess Zafarrancho directly from Colombia, Gavas Beat and DJ Mateo. Please join us at Bulgarian Macedonian Cultural Center on July 1st, at 9:00 p.m.</p>\n<p></p>\n<p>$20 In advance<br />$25 At the door</p>\n<p></p>\n<p><a href=\"https://www.picatic.com/PreIndependenceColombianParty2017\" class=\"more-info\">Purchase Tickets</a></p>\n<p></p>\n<p><em>All proceeds will support the activities of Colombia en Pittsburgh</em></p>\n<p><a href=\"https://www.picatic.com/PreIndependenceColombianParty2017\"><img src=\"/admin/uploads/aeb90d03-4c93-4d0a-c273-97435d4640c2.png\" /></a></p>","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("64","2017-06-29 21:38:50","2","2017-06-29 21:41:17","2","1","Noche de trovas","noche-de-trovas","0","0","past","2017-07-02 00:00:00","8:00 pm - 10:00 pm","The Colombian Spot","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3037.099483444077!2d-79.9789836846037!3d40.42879597936371!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834f16e46d8a859%3A0x2133cfd74c46ee39!2s2019+E+Carson+St%2C+Pittsburgh%2C+PA+15203!5e0!3m2!1sen!2sus!4v1498786695482\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>","0","0","<p>Por primera vez en Pittsburgh - Noche de Trovas desde Medellin - Colombia</p>\n<p></p>","<p>El show de trova animará la noche en Pittsburgh en el restaurante Colombiano - The Colombian Spot.<br />Ven y pasa una noche inolvidable!! Los esperamos</p>\n<p>The Colombian Spot <br />2019 E Carson St, Pittsburgh, PA 15203 <br />Boletas  $5  (Cash) BYOB</p>\n<p>- All proceeds will support the activities of Colombia en Pittsburgh</p>","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("65","2017-07-28 09:20:39","1","2022-09-19 21:08:21","2","1","Consulado Móvil de Colombia en Newark visitará Pittsburgh","consulado-movil-de-colombia-en-newark-visitara-pittsburgh-1","0","0","past","2017-07-29 00:00:00","9:00 am – 2:00 pm","LATINO FAMILY CENTER<br>\n5450 Second Avenue 2nd Floor<br>\nPittsburgh, PA 15207","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d347.23002739167146!2d-79.9413565800132!3d40.401408774474426!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834f1ca7e763fd3%3A0x5129cdf3214daf26!2s5450+Second+Avenue%2C+Pittsburgh%2C+PA+15207!5e0!3m2!1sen!2sus!4v1501248018266\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>","0","0","","<p>Hola a todos,<br />este sábado 29 de julio, el consulado de Neward vendrá nuevamente a Pittsburgh.</p>\n<p>Trámites que se atenderán:</p>\n<ul>\n<li>Autenticaciones</li>\n<li>Cédula</li>\n<li>Cédulas duplicado</li>\n<li>Pasaportes</li>\n<li>Permiso de salida del pais a menores</li>\n<li>Supervivencia</li>\n</ul>\n<p>Los requisitos para el trámite de estos documentos se encuentran en los documentos adjuntos.</p>\n<p>Forma de pago: Money order</p>\n<p>Para asegurar que los documentos lleguen con prontitud a su destino, asegúrense de llevar consigo correo certificado prepagado (USPS priority mail, UPS or Fedex)</p>\n<p><a href=\"/admin/uploads/servicios-consulares1.jpg\"><img src=\"/admin/uploads/servicios-consulares1.jpg\" width=\"1000\" height=\"770\" /></a></p>\n<p></p>\n<p><a href=\"/admin/uploads/servicios-consulares2.jpg\"><img src=\"/admin/uploads/servicios-consulares2.jpg\" width=\"1000\" height=\"773\" /></a></p>","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("66","2017-10-03 08:53:15","1","2017-10-04 15:01:10","1","1","Fiesta de los Niños 2017","fiesta-de-los-ninos-2017","0","0","past","2017-10-28 00:00:00","1pm – 5pm","Latino Family Center<br/>\n5450 Second Avenue 2nd Floor<br/>\nPittsburgh, PA 15207","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d1478.5389817316186!2d-79.94352807682486!3d40.4021090444811!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834f1ca7e763fd3%3A0x5129cdf3214daf26!2s5450+Second+Avenue%2C+Pittsburgh%2C+PA+15207!5e0!3m2!1sen!2sus!4v1507035173311\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>","0","0","","<p>Come be O\'Mazed by the magic of O\'Ryan the O\'Mazing!</p>\n<p><strong>1:30pm - 2:30pm</strong><br />Magician O\'Ryan the O\'Mazing</p>\n<p><strong>3:00pm – 5:00pm</strong><br />Balloon Artist, Billy Heh</p>\n<p><strong>4:00pm – 5:00pm</strong><br />Custom pasarela, crafts &amp; Trick or Treat!</p>\n<p>Entertainment, food, and drinks for the kids!</p>\n<p>Everyone is welcome!! Bring a plate to share!</p>","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("67","2017-10-03 08:55:34","1","2017-10-04 15:11:16","1","1","Fiesta de Halloween 2017","fiesta-de-halloween-2017","0","0","past","2017-10-28 00:00:00","10pm","Colombian Spot<br/>\n2019 E. Carson St.<br/>\nPittsburgh, PA 15203","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d288.15103265462665!2d-79.97701880699022!3d40.42874565417354!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834f16e46d8a859%3A0xf96b4800bdc76c61!2sThe+Colombian+Spot!5e0!3m2!1sen!2sus!4v1507035317449\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>","0","0","","<p>Come join us for a great Halloween party with the best Latin music by DJ Mateo! Prize for the best costume of the night. Help us support the Latino Family Center and our halloween party for the latino kids in Pittsburgh!</p>\n<p>$5 Cover<br />DJ Mateo</p>\n<p>BYOB / $5 corkage fee per bottle of wine/liquor, or per 12 beers<br />Menu: picada, hamburguesas, perros, empanadas &amp; salchipapa</p>\n<p><strong>Costume Required!</strong><br /><em>Prize for the best costume!</em></p>\n<p>Proceeds benefit the Fiesta de los Niños celebration.</p>","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("68","2018-02-01 22:32:32","2","2018-03-22 15:23:56","2","3","Segunda jornada de recolección de firmas ","segunda-jornada-de-recoleccion-de-firmas","0","0","past","2018-02-03 00:00:00","","","","0","0","<p>¿Quiénes?: Colombianos y Colombianas <br /> ¿Cuándo? : 1 de Febrero y 3 de Febrero (Diferentes horas) <br /> Objetivo: Recoger 150 firmas solicitando un puesto de votación en Pittsburgh</p>\n<p></p>","<p>Estimados Colombianos(as),</p>\n<p>Si estás interesado(a) en votar para las elecciones presidenciales de este año y resides en Pittsburgh ó sus alrededores, el grupo de Colombia en Pittsburgh está recogiendo firmas para poder solicitar un puesto de votación en la ciudad de Pittsburgh el día 27 de mayo del 2018.</p>\n<p>Si nos quieres ayudar a recoger estas firmas y puedes firmar, acércate a alguno de estos puntos en la ciudad de Pittsburgh con tu cédula colombiana.</p>\n<p>Jueves 1 de febrero de 2018 <br />3:00 a 7:00pm <br /> 1036 Granite Dr. McDonald, PA 15057<br /> Angela: 412-925-2318</p>\n<p>Sábado 3 de febrero de 2018 <br />10:00 a 12:00pm<br /> University of Pittsburgh, Posvar Hall 230 S<br /> Bouquet st Pittsburgh, PA Salón 4130<br />Diana: 412-620-3817</p>\n<p>Sábado 3 de febrero de 2018 <br />4:00 a 7:00pm <br /> The Colombian Spot <br />2019 East Carson Street (Southside)<br />Braulio: 806-445-7675</p>\n<p>*** NO OLVIDAR CEDULA DE CIUDADANIA E INSCRIPCION DE LA MISMA COMO SITIO DE VOTACION NEWARK - PHILADELPHIA ***<br /><a href=\"https://tramitesmre.cancilleria.gov.co/tramites/enlinea/solicitarInscripcionEnLinea.xhtml\">https://tramitesmre.cancilleria.gov.co/…/solicitarInscripci…</a></p>","","Learn more","0","","");
