INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("70","2018-06-29 08:33:24","1","2018-10-11 11:35:39","2","1","Pre-Independence Joropo party with Sergio Nicolas","pre-independence-joropo-party","0","0","past","2018-07-13 00:00:00","7:00 – 8:30pm","Hot Metal Bridge Faith Community<br/>\n2700 Jane St, Pittsburgh, PA 15203","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d12148.758502905053!2d-79.98488701297993!3d40.42679981982144!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x9d80de928088719!2sHot+Metal+Bridge+Faith+Community!5e0!3m2!1sen!2sus!4v1530275554812\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>","0","1","<p>Colombian Harpist, Sergio Nicolas, and his sister, Tatiana Aguirre, on cuatro,maracas, and bandola.</p>\n<p>The event is open to the public.</p>\n<p>Donations are welcome – all proceeds to benefit this group of young musicians.</p>","","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("71","2018-10-11 11:03:24","2","2020-05-11 10:18:13","1","1","Palenque - Come Experience Colombia","palenque-come-experience-colombia","0","0","past","2018-10-26 00:00:00","7:00 pm","Kelly Strayhorn Theater<br/>\n5941 Penn Avenue<br/>\nPittsburgh PA 15206","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3035.6054774401937!2d-79.92741458460272!3d40.4618681793599!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834f27392c57d2d%3A0xa29fdbc9ebde31bb!2sKelly%20Strayhorn%20Theater!5e0!3m2!1sen!2sus!4v1589206518661!5m2!1sen!2sus\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0;\" allowfullscreen=\"\" aria-hidden=\"false\" tabindex=\"0\"></iframe>","0","0","<p>Palenque celebrates Colombia’s rich history in music, dance and poetry. The concert will pay tribute to this culture’s compelling African ancestry while merging traditional and contemporary artistic expressions. Rhythm, song, movement and the spoken word will transport the audience to a typical scene in a Colombian village.</p>\n<p>Artistic Director: <br /> Melissa Teodoro</p>\n<p>With the participation of:<br /> SRU Afro-Colombian Dance Ensemble<br /> Grupo Bésame</p>","","https://kelly-strayhorn.secure.force.com/ticket/#sections_a0F6100000KIFk2EAH","Buy tickets","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("72","2019-06-20 16:24:48","1","2019-08-09 17:49:10","1","1","Pre-Independence Colombian Party 2019","pre-independence-colombian-party-2019","0","0","past","2019-07-06 00:00:00","9pm","Cake Pittsburgh<br/>\n1900 Smallman Street<br/>\nPittsburgh, PA 15222","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3036.083416240037!2d-79.98691958460307!3d40.45129067936118!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834f3dd12386f5d%3A0xe61669acba915739!2s1900+Smallman+St%2C+Pittsburgh%2C+PA+15222!5e0!3m2!1sen!2sus!4v1561385072292!5m2!1sen!2sus\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>","0","0","<p>If you would like to have an awesome event and a night full of dancing and great friends and support the latino community, please come and celebrate the Pre-Independence Colombian party with us!</p>","<p>All night of Latin music and dancing with our special guest group Zafarrancho directly from Colombia, Dj Mateo &amp; Dj Juan Diego.</p>\n<p>Zafarrancho is a Colombian musical group of tropical fusion, their music is a perfect blend between tradition and the future, and the heritage of the popular tropical sound with an alternative color and executed by young people. It is a delicious recipe that sounds like parranda and sancocho de domingo. Its staging spreads the soul of joy and becomes the fastest vehicle to travel to Colombia. More than notes this group brings the flavor of the neighborhood, the smell of homemade food, and the memories of the street of childhood. For all that it transmits, Zafarrancho has become a Colombian cultural ambassador worldwide.</p>\n<p><a href=\"https://www.eventbrite.com/e/pre-independence-colombian-party-2019-tickets-63168060369\" class=\"btn\">Get Tickets</a></p>","","","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("73","2020-05-09 08:42:19","1","2022-07-23 23:04:03","1","1","Consulado Móvil de Colombia","consulado-movil-de-colombia","1","0","past","2019-09-27 00:00:00","9am – 1pm","230 S Bouquet St.<br>\nPittsburgh, PA 15213-4240","","0","0","<p>El Consulado General de Colombia en Newark organiza Consulado Móvil en Pittsburgh el sábado 7 de Septiembre de 9:00 a.m. a 1:00 p.m. Registros y Cédulas con cita previa.</p>\n<p>NO se hacen procesos de tarjetas de identidad</p>\n<p>El pago se debe hacer en Money Order.</p>\n<h3>REQUISITOS</h3>\n<h4>1. Pasaportes</h4>\n<p>Pasaporte Ordinario:<br />Valor: USD $145.00 en Money Order a nombre del Consulado de Colombia.<br />Mayores de 18 años:<br />· Cédula de ciudadanía (amarilla de hologramas) o contraseña vigente.<br />· Pasaporte anterior si lo tiene.<br />·*Si la contraseña es de Cédula por primera vez, se requiere copia autentica del Registro Civil de Nacimiento.<br />Menores de 18 años:<br />· Cédula de ciudadanía del padre o madre que acompañe al menor.<br />· Copia auténtica del Registro Civil de Nacimiento del menor.<br />· Pasaporte anterior si lo tiene.<br />· En caso de que el menor esté acompañado por un tercero, se deberá presentar copia del documento de quien acompañe al menor y poder especial para tramitar pasaporte debidamente notarizado por los padres.<br />Entrega de pasaportes:<br />Mayores de 18 años:<br />· Presencia personal del titular.<br />· Cédula de ciudadanía.<br />Menores de 18 años:<br />· Presentación personal de quien realizó el trámite con el menor.<br />· Cédula de ciudadanía del padre, madre o tercero autorizado que registró su huella dactilar en el sistema digital al momento de la solicitud.<br />Envío de pasaporte:<br />·Traer un sobre de correo certificado junto con las estampillas correspondientes (10 usd en estampillas) o un sobre certificado pagado.<br />· Diligenciar el formato de autorización de envío.<br />Plazo máximo para reclamar pasaporte: recuerde que el titular del pasaporte tendrá un plazo máximo de seis (6) meses para reclamarlo. En caso que no lo reclame en este período, el documento será anulado y el solicitante deberá tramitar y pagar un nuevo pasaporte.</p>\n<h4>2. Actos notariales</h4>\n<p>Documento de identificación:<br />· Extranjeros: Pasaporte vigente o licencia de conducción.<br />·Colombianos: Cédula de Ciudadanía o contraseña vigente.<br />Autenticación de la Firma<br />Valor: USD $24.00 (Por cada firma) en Money Order a nombre del Consulado de Colombia.<br />·Para la autenticación de la firma en cualquier tipo de poder especial o declaraciones extraproceso o juramentadas, se requiere que el poder sea elaborado previamente por el interesado, quien debe presentarse personalmente.<br />· Todo poder o autorización sobre compraventa de inmuebles debe contener la ubicación del mismo, el número de matrícula inmobiliaria e informar si se encuentra afectado por patrimonio familiar.<br />·Documento de identificación.<br />Poder General<br />Valor: USD $384.00 en Money Order a nombre del Consulado de Colombia.<br />· Minuta de la escritura pública impresa y remitirla por correo electrónico a: cnewark@cancilleria.gov.co<br />·Documento de identificación.<br />Nota: Es necesario tener en cuenta que todo poder general debe conferirse por escritura pública y para el efecto, se debe presentar cuando se cita para sus respectivas firmas.<br />Certificado de Residencia<br />Valor: USD $43.00 en Money Order a nombre del Consulado de Colombia.<br />· Documentos que demuestren la residencia en los Estados Unidos de los tres (3) últimos años, tales como: recibos de servicios, tarjeta de residencia, certificado de trabajo, income tax o licencia de conducir.<br />·Documento de identificación.<br />Declaración de Soltería<br />Valor: USD $24.00 en Money Order a nombre del Consulado de Colombia.<br />· El interesado deberá presentarse con dos testigos quienes declararán bajo la gravedad de juramento sobre el estado civil del interesado.<br />·Documento de identificación.</p>\n<h4><br />3. PERMISOS A MENORES PARA SALIR DE COLOMBIA</h4>\n<p>Valor: USD $24.00 en Money Order (Por cada firma) a nombre del Consulado de Colombia.<br />· Documento de identidad del padre que otorga el permiso.<br />· Registro de Nacimiento de Menor.<br />· Información: Apellidos, nombres completos y número de identificación de la persona autorizada a viajar con el menor, destino, motivo de viaje y fecha exacta de la salida de Colombia del menor o periodo de tiempo.</p>\n<h4>4. Supervivencias</h4>\n<p>Valor: No tiene Costo.<br />· Presencia del ciudadano.<br />· Documento de identidad.<br />Nota: Los certificados de supervivencia, deben tramitarse cada 6 meses.</p>\n<h4>5. Documentación</h4>\n<p>Fotografías: 4cm x 5cm, de frente, a color, con fondo blanco, ropa oscura, sin accesorios y orejas destapadas, donde la cara ocupe mínimo 2.5 cm x 3.5 cm. Si el cabello es muy claro el fondo debe ser azul claro.</p>\n<h4>6. Cédula de ciudadanía</h4>\n<p>Cédula de Ciudadanía por primera vez:<br />(Ciudadano de dieciocho (18) años o más que no ha solicitado previamente Cedula de Ciudadanía)<br />· Dieciocho (18) años cumplidos.<br />· Registro Civil de nacimiento colombiano con sello original, emitido directamente por la oficina donde se efectuó la inscripción.<br />· Tres fotografías.<br />· Conocer el grupo sanguíneo y el factor RH.<br />· Solicitantes mayores de 25 años se le tramitará verificación de huellas y autorización de expedición a la Registraduría Nacional.<br />Renovación de Cédula de Ciudadanía:<br />· Conocer el grupo sanguíneo y el factor RH.<br />· Tres fotografías.<br />· No tiene costo<br />Duplicado de Cédula de Ciudadanía:<br />(Para quienes previamente solicitaron Cédula amarilla con holograma)<br />· Conocer el número de la cédula.<br />· Presentar un documento que lo identifique como colombiano (Pasaporte, licencia de conducción o Registro Civil).<br />· Tres fotografías.<br />· Conocer el grupo sanguíneo y el factor RH.<br />· USD $44.36 / Money Order<br />Rectificación de Cédula de Ciudadanía:<br />· Cédula de ciudadanía original.<br />· Copia auténtica del registro civil de nacimiento, en donde se indique el dato a rectificar.<br />· Tres fotografías.<br />· Conocer el grupo sanguíneo y el factor RH.<br />· USD $44.36 / Money Order<br />Tarjeta De Identidad:<br />· El menor debe tener entre siete y dieciocho años<br />· Tres fotografías.<br />· Copia auténtica del Registro Civil de Nacimiento.<br />· Conocer el Grupo sanguíneo y factor RH.</p>\n<h4>7. Registro Civil</h4>\n<p>El consulado conservará el registro original<br />Registro civil de nacimiento<br />Registro del hijo que nace dentro del matrimonio:<br />· Presencia de la persona a inscribir.<br />· Original del certificado de nacimiento estadounidense, donde figuren los nombres de los padres. Debe estar debidamente apostillado.<br />· Traducción del registro.<br />· Identificación de los padres: si son colombianos deben presentar original y copia de la Cédula de Ciudadanía, y si alguno es extranjero debe presentar original y copia de su pasaporte vigente o licencia de conducir estadounidense.<br />· Registro de Matrimonio.<br />· Tipo de sangre y factor RH del menor.<br />· Presencia de uno de los padres. En caso que uno de los dos posea otra nacionalidad, el colombiano es quien debe registrar al menor.<br />Registro del hijo fruto de unión libre:<br />· Presencia de la persona a inscribir y de los padres.<br />· Original del certificado de nacimiento estadounidense donde figuren los nombres de los padres, tal como están en las Cédulas de Ciudadanía. Debe estar apostillado.<br />· Traducción del registro.<br />· Identificación de los padres: si son colombianos deben presentar original y copia de la Cédula de Ciudadanía, y si alguno es extranjero, debe presentar original y copia de su pasaporte vigente o licencia de conducir estadounidense.<br />· Tipo de sangre y factor RH del menor.<br />Registro de matrimonio:<br />· Registro original de matrimonio estadounidense debidamente apostillado.<br />· Traducción del registro.<br />· Cédula de Ciudadanía de cada uno de los contrayentes y copia de la misma.<br />· Presencia de uno de los contrayentes o un representante autorizado.<br />· Si alguno es extranjero, debe presentar su pasaporte vigente o licencia de conducir estadounidense.<br />· Copia del registro civil de nacimiento del conyugue colombiano.<br />NOTA: Si uno de los contrayentes es divorciado, debe presentar el Registro Civil de Nacimiento con anotación de matrimonio y divorcio. Si es extranjero, debe presentar la sentencia del divorcio traducida al español.<br />Registro de defunción:<br />· Original del Certificado de defunción debidamente apostillado.<br />· Traducción del registro.<br />· Cédula de Ciudadanía del fallecido.<br />· Cédula del declarante. Si es extranjero, debe presentar su pasaporte vigente o licencia de conducir estadounidense.<br />· En registro y documento de identidad debe coincidir los nombres y fecha.</p>","","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("74","2020-05-09 09:05:14","1","2020-12-04 07:50:30","1","1","Celebración del Día de las Velitas 2019","celebracion-dia-velitas-2019","0","0","past","2019-12-07 00:00:00","7:30 PM – 9:30 PM","The Colombian Spot<br>\n2019 E Carson St.<br>\nPittsburgh, PA 15203","","0","0","<p>Colombia en Pittsburgh los invita a que nos reunamos en familia a encender las velitas y pasemos una noche inolvidable degustando de la deliciosa comida colombiana al son del grupo Bésame que nos trae su nuevo repertorio de música de navidad.</p>\n<p>Que cada velita que enciendas<br />este llena de mucho amor<br />alegría, paz y prosperidad.<br />que sea un excelente comienzo<br />de la mejor época del año</p>","","","Learn more","0","","");
