INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("76","2020-05-09 09:10:07","1","2020-05-11 10:19:10","1","1","Asamblea General","asamblea-general","0","0","past","2020-02-07 00:00:00","6:30pm – 8pm","East Liberty Presbyterian Church <br/>\nFellowship Room<br/>\n116 S Highland Ave.<br/>\nPittsburgh, PA 15206-3911","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3035.6492075931774!2d-79.92726088442362!3d40.46090046087548!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834f27385ada5d3%3A0xb1e83f57220990a7!2sEast%20Liberty%20Presbyterian%20Church!5e0!3m2!1sen!2sus!4v1589206735075!5m2!1sen!2sus\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0;\" allowfullscreen=\"\" aria-hidden=\"false\" tabindex=\"0\"></iframe>","0","0","<p>Colombia en Pittsburgh los invita a participar en la Asamblea General y en las elecciones de la nueva junta directiva. Ven y conoce más detalles de nuestra organización.</p>\n<p>Para mas información cep@colombiaenpittsburgh.org</p>","","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("77","2020-05-09 09:12:39","1","2020-05-09 09:14:15","1","1","Bolero Night Featuring Group Bésame","bolero-night-featuring-group-besame","0","0","canceled","2020-03-28 00:00:00","8pm – 10pm","La Palapa, Mexican Cuisine & Mezcal Bar<br/>\n2228 E Carson St.<br/>\nPittsburgh, PA 15203","","0","0","<p>Colombia en Pittsburgh los invita a disfrutar de una noche de boleros, amigos y una deliciosa comida.</p>\n<p>Entrada: $8</p>\n<p>Menu es a la carta!</p>\n<p>Compra tu boleta antes de que se agote, recuerda que quien lo vive es quien lo goza! </p>\n<p>https://cep-bolero-night.eventbrite.com</p>","","https://cep-bolero-night.eventbrite.com","Buy Tickets","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("78","2020-05-11 09:46:40","1","2022-07-07 11:18:58","1","1","Celebración del Día de la Independencia de Colombia","celebracion-del-dia-de-la-independencia-de-colombia-2019","0","0","past","2019-07-27 00:00:00","12pm – 6pm","Schenley Park Ice Rink<br>\nOverlook Drive<br>\nPittsburgh, PA 15213","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3036.9684378073525!2d-79.94742028460362!3d40.431697779363375!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834f18dab793e3f%3A0xe4a68c7f4d82a670!2sSchenley%20Park%20Ice%20Skating%20Rink!5e0!3m2!1sen!2sus!4v1589206212771!5m2!1sen!2sus\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0;\" allowfullscreen=\"\" aria-hidden=\"false\" tabindex=\"0\"></iframe>","0","0","<p><strong>1:00pm:</strong> Misa en español ofrecida por el Rev. Fernando Torres.</p>\n<ul>\n<li>Contaremos con la participación de los grupos Bésame &amp; Gavas Beat y el gran DJ Juan Diego.</li>\n<li>Invitado especial: Guillermo Borrero - Psiquiatra colombiano radicado en Pittsburgh, recientemente presento su libro HISTORIA DE LA TRISTEZA en la Feria Internacional del Libro Bogotá - 2019, elegida como la novela del día por City TV.</li>\n<li>También tendremos actividades para niños y adultos</li>\n<li>Pintacaritas</li>\n<li>Juegos para adultos &amp; niños</li>\n<li>Deliciosa comida Latinoamericana por Totopo Mexican Kitchen, AJ\'s Peruvian Restaurant, Cafe La Argelia y mucho más</li>\n<li>Una oportunidad más para reunirnos con nuestra familia y amigos y celebrar una de las fechas mas importantes de nuestra querida Colombia!!</li>\n</ul>\n<p>Esperamos contar con su asistencia!</p>","","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("79","2020-05-11 10:25:39","1","2020-05-11 10:25:39","1","1","Trova Cómica Parrandera","trova-comica-parrandera","0","0","past","2019-07-07 00:00:00","6pm – 8pm","The Colombian Spot<br/>\n2019 E Carson St.<br/>\nPittsburgh, PA 15203","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3037.0992990397776!2d-79.9789836844243!3d40.42880006282878!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834f16e46d8a859%3A0xf96b4800bdc76c61!2sThe%20Colombian%20Spot!5e0!3m2!1sen!2sus!4v1589207076148!5m2!1sen!2sus\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0;\" allowfullscreen=\"\" aria-hidden=\"false\" tabindex=\"0\"></iframe>","0","0","<p>Ven y pasa una noche inolvidable al son de trovas, una deliciosa comida Colombiana y buenos amigos. Los esperamos!!</p>\n<p>Hora: 5:00 PM<br />Boletas: $5 (Cash)<br />BYOB</p>\n<p>No se aceptan reservaciones.</p>\n<p>\"All proceeds will support the activities of Colombia en Pittsburgh\"</p>\n<p>Trovador antioqueño que se caracteriza por su estilo de improvisación alegre y fiestero pero con un verso lleno de inteligencia y elegancia. Ha sido rey del Festival Internacional de la Trova de Estados Unidos (2017), ha inaugurado tres Ferias de las Flores y ha compartido escenarios junto a Pucheros, Minisigüí, Dinamita, Tutti Frutti y Jhon Jairo Pérez. Ha girado por países como Panamá, República Dominicana, Estados Unidos, Francia, España e Italia y se ha desempeñado como analista del Festival Nacional de la Trova Ciudad de Medellín para medios como Caracol y Rcn.</p>","","https://www.facebook.com/events/864364970588170/","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("80","2020-05-11 10:59:06","1","2020-05-11 10:59:06","1","1","Colombia vs. Argentina","colombia-vs.-argentina","0","0","past","2019-06-15 00:00:00","6pm","The Colombian Spot<br/>\n2019 E Carson St.<br/>\nPittsburgh, PA 15203","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3037.0992990397776!2d-79.9789836844243!3d40.42880006282878!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834f16e46d8a859%3A0xf96b4800bdc76c61!2sThe%20Colombian%20Spot!5e0!3m2!1sen!2sus!4v1589207076148!5m2!1sen!2sus\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0;\" allowfullscreen=\"\" aria-hidden=\"false\" tabindex=\"0\"></iframe>","0","0","<p>Live streaming of the game ! BYOB</p>","","https://www.facebook.com/events/2333701910284606/","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("81","2020-05-11 11:03:42","1","2020-05-11 11:05:07","1","1","Music and Poetry from the Colombian Conflict","music-poetry-colombian-conflict","0","0","past","2019-01-31 00:00:00","7pm – 9pm","Alphabet City<br/>\n40 W North Ave.<br/>\nPittsburgh, PA 15212","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d194323.8342381663!2d-80.03064944852903!3d40.44627723463636!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834f3f78caa381d%3A0x8a4626f6c16d9eff!2sAlphabet%20City!5e0!3m2!1sen!2sus!4v1589209274580!5m2!1sen!2sus\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0;\" allowfullscreen=\"\" aria-hidden=\"false\" tabindex=\"0\"></iframe>","0","0","<p>Hosted by Alia Musica Pittsburgh, City of Asylum, Colombia en Pittsburgh and Center for Latin American Studies (CLAS) at Pitt</p>\n<p>AMP presents poetry, discussion, and music interweaved in the memory of the Colombian armed conflict.</p>\n<h3>[FREE RSVP]</h3>\n<p>Works of chamber music stemming from different aspects of the conflict, with a special appearance by professors John Beverley, Juan Fernando Velasquez, and Colombian poet Piedad Bonnett (winner of the National Poetry Prize 1994 and the Casa de las Américas award 2014, among others), whose poems are musicalized in Johan Hassler\'s work, La Cicatriz en el Espejo. With a panel discussion with special guests, poet Piedad Bonnet, and literary and cultural critic John Beveley.</p>\n<h3>PROGRAM</h3>\n<ul>\n<li>Nicolás Aguía: La Bonanza del Olvido. Film, narration, and electronics, on conflict testimonies from Choco inhabitants collected by Luis Fernando Gómez.</li>\n<li>Federico Garcia-De Castro: Memoria (homage to Bernardo Jaramillo Ossa). Soprano, guitar, violin, cello, percussion</li>\n<li>Johann Hasler: La Cicatriz en el Espejo and two other songs on poems by Piedad Bonnet. Soprano, flute, accordin, percussion</li>\n</ul>\n<h3>Música y poesía del conflicto colombiano</h3>\n<p>Alia Musica presenta poesía, discusión, y música entretejidas en la memoria del conflicto armado colombiano. Obras de música de cámara surgidas de diversos aspectos del conflicto, con la participación especial de los profesores John Beverley, Juan Fernando Velásquez, y la poetisa Piedad Bonnet (ganadora del premio nacional de poesía 1994 y Casa de las Américas 2014, entre otros), tres de cuyos poemas aparecen musicalizados en la obra de Johan Hassler, La Cicatriz en el Espejo.</p>\n<p><em>This program will be presented in Spanish with English translation available</em></p>","","https://www.facebook.com/events/752139621833715/","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("82","2020-12-04 07:51:34","1","2020-12-08 10:11:40","1","1","Celebración del día de las velitas 2020","celebracion-dia-velitas-2020","0","0","past","2020-12-07 00:00:00","7:30pm – 9:00pm","Evento virtual en Zoom, detalles en la <a href=\"https://www.facebook.com/colombiaenpittsburgh\">página de Facebook</a> de Colombia en Pittsburgh.","","1","0","<p>Colombia en Pittsburgh los invita a reunirnos virtualmente en familia a encender las velitas y a pasar una linda noche cantando villancicos y dándole la bienvenida a la navidad.</p>\n<p>Que cada velita que encendamos<br />esté llena de mucho amor<br />alegría, paz y prosperidad,<br />que sea un excelente comienzo<br />de la mejor época del año!</p>","","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("83","2021-03-24 21:23:46","2","2022-07-07 11:48:29","1","1","Recolección de firmas para elecciones presidenciales 2022","firmas-para-elecciones-presidenciales-2022","0","0","past","2021-03-20 00:00:00","Marzo 20 - Abril 4, 2021","Various locations and times","","1","0","<p>Hagamos que Pittsburgh sea considerado como puesto de votación para las elecciones presidenciales 2022-2026. Ayúdanos firmando nuestra petición en alguna de las ubicaciones listadas en la parte de abajo a partir del sábado 20 de marzo hasta el domingo 4 de abril.</p>\n<p>Casa San José<br />2116 Broadway Ave<br />Pittsburgh, PA 15216<br />Lunes - Viernes<br />9:00 AM - 4:00 PM</p>\n<p>Pittsburgh Hispanic Development Corporation: PHDC Business Incubator, Pittsburgh Hispanic Development Corporation<br />1555 Broadway Avenue, Second Floor<br />Pittsburgh PA 15216<br />Lunes - Viernes<br />9:00 AM - 4:00 PM</p>\n<p>Restaurante Colombiano<br />The Colombian Spot<br />2019 E Carson St<br />Pittsburgh, PA 15203<br />Martes - Domingo<br />11:00 AM - 8:00 PM</p>\n<p>Colombino Farmers: Colombino Farmers<br />2031 Penn Ave, Pittsburgh, PA 15222<br />Lunes - Domingo<br />9:00 - 3:00 PM</p>","","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("84","2022-07-07 11:21:28","1","2022-07-19 10:18:43","1","1","Conmemoración del día de la independencia de Colombia","20-de-julio-2022","0","0","past","2022-07-24 00:00:00","12pm – 4pm","Carnegie Mellon University<br>\nMerson Courtyard & Legacy Plaza<br>\nJared L. Cohon University Center<br>\n5032 Forbes Avenue<br>\nPittsburgh, PA 15213","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3036.455867590803!2d-79.94411507876337!3d40.44304618619393!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834f221dd43ae17%3A0xa894bdf2f5efc7!2sMerson%20Courtyard%2C%20Pittsburgh%2C%20PA%2015213!5e0!3m2!1sen!2sus!4v1658239453729!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>","1","0","","<p><img src=\"/admin/uploads/20-de-julio-2022-details.jpg\" width=\"1000\" height=\"420\" alt=\"\" /></p>\n<p><img src=\"/admin/uploads/20-de-julio-2022-amigos.jpg\" width=\"1000\" height=\"399\" alt=\"\" /></p>","https://www.facebook.com/events/1198573150986982/?ref=newsfeed","RSVP on Facebook","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("85","2022-07-24 07:52:45","1","2022-07-24 08:00:51","1","1","Convocatoria para proyectos en Colombia para mitigar el impacto generado por el COVID-19: Resultados","convocatoria-resultados","0","0","past","2020-12-01 00:00:00","","","","0","0","<p>Felicitaciones a las tres propuestas ganadoras y muchas gracias a todos por su interés y por su generosidad buscando ayuda para nuestros compatriotas afectados con la emergencia sanitaria.</p>\n<p><img src=\"/admin/uploads/ganadoes_cep-02_002.jpg\" width=\"1000\" height=\"1292\" alt=\"\" /></p>","","","Learn more","0","","");
INSERT INTO `#TABLE_PREFIX#_main_feed` VALUES("86","2022-09-19 21:30:57","2","2022-09-21 11:13:13","1","1","Consulado Móvil de Colombia en Newark visitará Pittsburgh","consulado-movil-newark-2022","0","0","upcoming","2022-09-24 00:00:00","8:30 am – 3:00 pm","Pittsburgh Hispanic Development Corporation<br>\n1555 Broadway Ave, Second Floor<br>\nPittsburgh, PA 15216","<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3037.9144260918124!2d-80.02660788460423!3d40.410746479365905!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8834f6d9288ef771%3A0x9e63c5d0e12d58af!2sPittsburgh%20Hispanic%20Development%20Corporation!5e0!3m2!1sen!2sus!4v1663636214464!5m2!1sen!2sus\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>","0","0","","<p style=\"text-align: left;\">Hola a todos,<br />Este sábado 24 de septiembre, el consulado de Newark vendrá nuevamente a Pittsburgh.</p>\n<p style=\"text-align: left;\">Trámites que se atenderán:</p>\n<p style=\"text-align: left;\">- Pasaportes (ordinario, de emergencia, ejecutivo)<br />https://newark.consulado.gov.co/tramites.../pasaportes/</p>\n<p style=\"text-align: left;\">- Actos notariales (certificaciones, autenticación de firma, permisos a menores para salir del pais, supervivencias)<br />https://newark.consulado.gov.co/tramite.../tramites_exterior</p>\n<p style=\"text-align: left;\">** NO se prestarán servicios de registraduría **</p>\n<p style=\"text-align: left;\">Por favor inscríbase <a href=\"https://l.facebook.com/l.php?u=https%3A%2F%2Fcolombiaenpittsburgh.wufoo.com%2Fforms%2Fanecesita-servicios-consulares%2F%3Ffbclid%3DIwAR3TlP2Ou3kjUbc8rvv7z9z42Xnbh58GQPd_kdr5d-05ZuGVUMkvDKHQsFY&amp;h=AT3mZX01Vn1ChYru8EKuwqfTg4fYD5cM38liOnlGf5Lxp2HePusbOat2j2imgwKbhzk5rVTGi_ozl7P6QcAVWIVorM5WGabG3zLL1-u16DoIn9DmLRXVGBRFOTS8uAM&amp;__tn__=q&amp;c[0]=AT0ZSCjHKOi5ga5UsqESDKU8EFklhXJD6a_kXlZEDkqUttM7Lt-1rTOvMOJ7h_bN3TB9h28ULl0lYKyWZaKwjUzl1kglPaocfH6B20FXhf2zWKnTP4S2YolqYXucivi-P3qGvaWDrzjXydBM46qz2y2NJtOB53R27CYcV3Y6f7Ioxm50\">aqui</a> y lo llamaremos a confirmar la hora de la cita. Gracias!</p>\n<p style=\"text-align: left;\"><strong>Si ya  tiene cita,</strong> por favor registrese <a href=\"https://tramitesmre.cancilleria.gov.co/tramites/enlinea/registrarCiudadano.xhtml\">aqui</a> </p>\n<p style=\"text-align: left;\">Los requisitos para el trámite de estos documentos se encuentran en los documentos adjuntos.</p>\n<p style=\"text-align: left;\">Forma de pago: Money order</p>\n<p style=\"text-align: left;\">Para asegurar que los documentos lleguen con prontitud a su destino, asegúrense de llevar consigo correo certificado prepagado (USPS priority mail, UPS or Fedex)</p>\n<p style=\"text-align: left;\"><img src=\"/admin/uploads/whatsapp-image-2022-09-19-at-8-26-55-pm-(3).jpeg\" width=\"1000\" height=\"597\" alt=\"\" /></p>","","Learn more","0","","");

