INSERT INTO `#TABLE_PREFIX#_miscellaneous_pages` VALUES("1","2020-05-11 17:50:07","1","2020-08-07 12:43:07","1","10","0","Convocatoria para proyectos en Colombia para mitigar el impacto generado por el COVID-19","convocatoria-abierta","<p>Colombia en Pittsburgh tiene como misión trabajar por el bienestar de los colombianos y apoyar proyectos de carácter filantrópico en Colombia. Con esto en consideración, abrimos una convocatoria para presentar propuestas de proyectos con alcance en Colombia, para mitigar el impacto generado por la emergencia sanitaria actual. </p>\n<p>Si tiene alguna inquietud, por favor comuníquese vía correo electrónico a <a href=\"mailto:cep@colombiaenpittsburgh.org\">cep@colombiaenpittsburgh.org</a>.</p>\n<h3>Resultados</h3>\n<p>Felicitaciones a las tres propuestas ganadoras y muchas gracias a todos por su interés y por su generosidad buscando ayuda para nuestros compatriotas afectados con la emergencia sanitaria.</p>\n<p><img src=\"/admin/uploads/ganadoes_cep-02.jpg\" width=\"1000\" height=\"1545\" alt=\"\" /></p>","0","","<div class=\"box\">\n<h5>Fundación 33 Sueños</h5>\n<p class=\"flexible-container\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/BOJwyobNUZw\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<h5>Asociación Afromirandeña Asoafromi</h5>\n<p class=\"flexible-container\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/rBwx765hsjI\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<h4 class=\"divider\">Cronograma de actividades</h4>\n<h5>Mayo 12, 2020</h5>\n<p>Publicación de convocatoria</p>\n<h5>Mayo 23, 2020</h5>\n<p>Fecha límite de presentación de propuestas</p>\n<h5>Junio 9, 2020</h5>\n<p>Publicación de propuestas seleccionadas</p>\n<h5>Junio 12, 2020</h5>\n<p>Remisión de documentos para formalización de la donación</p>\n<ul>\n<li>Forma de recepción del dinero</li>\n<li>Documento de compromiso firmado</li>\n</ul>\n<h5>Junio 15–19, 2020</h5>\n<p>Asignación de fondos. Siempre y cuando se haya remitido los documentos para formalizar el giro.</p>\n<h5>Agosto 15, 2020</h5>\n<p>Presentación de informe parcial de actividades</p>\n<ul>\n<li>Debe incluir fotografías y otras pruebas del uso de la donación</li>\n</ul>\n<h5>Noviembre 15, 2020</h5>\n<p>Presentación de informe final de actividades</p>\n<ul>\n<li>Debe incluir fotografías y otras pruebas del uso de la donación</li>\n</ul>\n</div>");
INSERT INTO `#TABLE_PREFIX#_miscellaneous_pages` VALUES("2","2020-06-10 10:39:09","1","2020-06-10 10:39:09","1","30","1","Backup: Convocatoria abierta para proyectos en Colombia para mitigar el impacto generado por el COVID-19","convocatoria-abierta-backup","<p><img src=\"/admin/uploads/covid19-banner-pg.jpg\" width=\"1000\" height=\"499\" alt=\"\" /></p>\n<p>Colombia en Pittsburgh tiene como misión trabajar por el bienestar de los colombianos y apoyar proyectos de carácter filantrópico en Colombia. Con esto en consideración, hemos abierto una convocatoria para presentar propuestas de proyectos con alcance en Colombia, que tengan como objetivo mitigar el impacto generado por la emergencia sanitaria actual. Si está interesado, lo invitamos a diligenciar el formulario que encuentra abajo y a revisar los parámetros de evaluación y cronograma de la convocatoria. </p>\n<p>Si tiene alguna inquietud, por favor comuníquese vía correo electrónico a <a href=\"mailto:cep@colombiaenpittsburgh.org\">cep@colombiaenpittsburgh.org</a>.</p>\n<h3>REQUISITOS</h3>\n<ol>\n<li>Que la propuesta contribuya a mitigar el impacto causado por el COVID-19 en la comunidad. </li>\n<li>Que la organización o fundación tenga experiencia sirviendo a comunidades. </li>\n<li>Que la organización no tenga ningún tipo de sanción penal, disciplinaria o fiscal  vigente </li>\n<li>Que la organización se encuentre reconocida legalmente.</li>\n<li>Que el proyecto no tenga ningún tipo de afiliación política.   </li>\n<li>Formulario debidamente diligenciado con toda la información requerida y documentos de soporte.   </li>\n<li>Suficiente estructura organizacional o grupo de trabajo para apoyar la iniciativa.</li>\n</ol>\n<p>La recepción de las propuestas no compromete a Colombia en Pittsburgh a realizar donación alguna, pero la organización tendrá la facultad de solicitar información adicional si se considera necesaria para la evaluación de las propuestas. </p>\n<p>Las propuestas serán evaluadas por el comité designado para tal efecto por la Junta Directiva de la organización. Se seleccionarán hasta tres (3) ganadores y se asignará una suma máxima de tres millones de pesos colombianos (3.000.000 COP) a cada uno.</p>\n<p>Colombia en Pittsburgh se reserva el derecho de conocer el destino de los dineros, para lo cual la organización o fundación responderá a las dudas que se tengan de la destinación y uso de los recursos.</p>","0","<div id=\"wufoo-m10ijqfo0kuqj8e\">\n</div>\n<div id=\"wuf-adv\" style=\"font-family:inherit;font-size: small;color:#a7a7a7;text-align:center;display:block;\">Use <a href=\"http://www.wufoo.com/gallery/templates/\">Wufoo templates</a> to make your own HTML forms.</div>\n<script type=\"text/javascript\">var m10ijqfo0kuqj8e;(function(d, t) {\nvar s = d.createElement(t), options = {\n\'userName\':\'colombiaenpittsburgh\',\n\'formHash\':\'m10ijqfo0kuqj8e\',\n\'autoResize\':true,\n\'height\':\'1638\',\n\'async\':true,\n\'host\':\'wufoo.com\',\n\'header\':\'show\',\n\'ssl\':true};\ns.src = (\'https:\' == d.location.protocol ? \'https://\' : \'http://\') + \'secure.wufoo.com/scripts/embed/form.js\';\ns.onload = s.onreadystatechange = function() {\nvar rs = this.readyState; if (rs) if (rs != \'complete\') if (rs != \'loaded\') return;\ntry { m10ijqfo0kuqj8e = new WufooForm();m10ijqfo0kuqj8e.initialize(options);m10ijqfo0kuqj8e.display(); } catch (e) {}};\nvar scr = d.getElementsByTagName(t)[0], par = scr.parentNode; par.insertBefore(s, scr);\n})(document, \'script\');</script>\n","<div class=\"box\">\n<h3>Cronograma de actividades</h3>\n<h5>Mayo 12, 2020</h5>\n<p>Publicación de convocatoria</p>\n<h5>Mayo 23, 2020</h5>\n<p>Fecha límite de presentación de propuestas</p>\n<h5>Junio 9, 2020</h5>\n<p>Publicación de propuestas seleccionadas</p>\n<h5>Junio 12, 2020</h5>\n<p>Remisión de documentos para formalización de la donación</p>\n<ul>\n<li>Forma de recepción del dinero</li>\n<li>Documento de compromiso firmado</li>\n</ul>\n<h5>Junio 15–19, 2020</h5>\n<p>Asignación de fondos. Siempre y cuando se haya remitido los documentos para formalizar el giro.</p>\n<h5>Agosto 15, 2020</h5>\n<p>Presentación de informe parcial de actividades</p>\n<ul>\n<li>Debe incluir fotografías y otras pruebas del uso de la donación</li>\n</ul>\n<h5>Noviembre 15, 2020</h5>\n<p>Presentación de informe final de actividades</p>\n<ul>\n<li>Debe incluir fotografías y otras pruebas del uso de la donación</li>\n</ul>\n</div>");
