INSERT INTO `#TABLE_PREFIX#_news` VALUES("20","2009-09-28 14:59:35","1","2009-09-28 15:30:23","1","Colombia en Pittsburgh Announces Board Members for 2009&ndash;2010","2009-09-28 00:00:00","","Pittsburgh, PA","1","<p>Colombia en Pittsburgh announces the election of its new Board Members for 2009 – 2010. We welcome:</p>\n<ul>\n<li>Santiago Lentijo, President</li>\n<li>David Salazar, Vice President</li>\n<li>María Cecilia Q. Dancisin, Treasurer</li>\n</ul>\n<p>A special thanks to the the 2008–2009 Board for their service, commitment and hard work. Please join us as we welcome the new board.</p>","0");
INSERT INTO `#TABLE_PREFIX#_news` VALUES("21","2009-09-28 15:19:29","1","2009-09-28 15:24:25","1","Colombia en Pittsburgh Presents 2009 Catleya Award to Dr. Juan Carlos Puyana, MD","2009-07-19 00:00:00","","Pittsburgh, PA","1","<p>Colombia en Pittsburgh is proud to announce the 2009 recipient of the Catleya Award - Dr. Juan Carlos Puyana, MD. The award was presented on July 19, 2009 at the 6th Annual Colombian Independence Day Commemoration and Celebration held at Emiliano\'s Restaurant.</p>\n<h3>About Dr. Puyana</h3>\n<p>Dr. Juan Carlos Puyana is currently an Associate Professor of Surgery and Critical Care, Trauma Surgeon, Director of Surgical ICU, Director of the Surgical Critical Care Program at the University of Pittsburgh Medical Center at Presbyterian Hospital.</p>\n<p>Dr. Puyana received his M.D. from Javeriana University in Bogota Colombia. He is an Editorial Board Member of the Adult Multi-Disciplinary Critical Care Knowledge Assessment Program.</p>\n<p><a href=\"/catleya/recipient.php?4\">Read More...</a></p>","0");
