INSERT INTO `#TABLE_PREFIX#_news` VALUES("33","2010-10-22 08:27:44","1","2010-10-22 08:29:01","1","Bésame to Launch First Album","2010-10-08 00:00:00","http://www.besamepittsburgh.com/","","1","<p>PITTSBURGH, PA (October 8, 2010) – After five years of sharing culture through music, Bésame will launch their first album, <i>Primer Beso</i> (First Kiss), with a release party on Sunday, October 24, 2010 at 6:00 PM.</p>\n<p>Bésame’s unique Latin musical combination was born in 2005, when Jorge Delgado, Paul Cindric and Melissa Alliston were invited to play at the Colombian Independence Day celebration hosted by Colombia in Pittsburgh. The infamous Roger Day was added a few months later to complete their sound. All four provide vocals and instrumentals throughout their performance, with Jorge on guitar, Paul on soprano sax, Melissa on percussion and Roger on tuba. This eclectic mix allows them to achieve everything from a pseudo big-band sound to modern popular music.</p>\n<p>With <i>Primer Beso</i>, Bésame brings on a collection of mostly Colombian tunes, with a few other countries thrown in for fun. To reach out to a larger audience, they also weave English lyrics through some of their arrangements. Originally from Bogota, Colombia, Jorge is Bésame’s musical impetus, and <i>Primer Beso</i> is the vehicle the group will use to take listeners on an audio tour that includes the rhythms of cumbia, porro, currulao, bolero, cha cha cha and even a gato (though perhaps not the one the Spanish majors in the room are imagining). Recorded in Pittsburgh at El Sótano, <i>Primer Beso</i> captures the feel of a live presentation so fans can have a piece of the show to take home with them.</p>\n<p>The launch is a free event that is both open to the public and family friendly. Thanks to the sponsorship of Pitt’s Center for Latin American Studies, the release will be celebrated in the Ballroom of the William Pitt Student Union in Pittsburgh’s Oakland neighborhood. Support is also provided by the Latin American Cultural Union and Colombia in Pittsburgh. For more information about Bésame and the launch, you can visit them online at www.besamepittsburgh.com, send an e-mail to <a href=\"mailto:info@besamepittsburgh.com\">info@besamepittsburgh.com</a>, or look them up on <a href=\"http://www.facebook.com/#!/pages/Besame/42210587996\">Facebook</a>.</p>\n<p><a href=\"/files/Besame-PrimerBeso.pdf\">Press Release (English)</a><br /><a href=\"/files/Besame-PrimerBeso-ESP.pdf\">Press Release (Español)</a></p>","0");
